INSERT INTO `publicaciones` VALUES (1,12,12,NULL,'2023-12-26',0,'mi','Dudar de lo que nos dijeron y de nuestras propias afirmaciones,de nuestros sentimientos, de nuestros sueños y de nuestros anhelos.Dudar como una manera de vivir el pensamiento y la acción,allí donde nos arroja el riesgo de un discurrir diferente,a la fragilidad de lo inciertoy a la ligereza de lo que se sabe precario,demasiado precario.'),(2,11,21,NULL,'2023-12-29',1,'amo','allí los ríos caudales,allí los otros medianosy más chicos'),(3,12,26,1,'2023-12-25',1,NULL,'por una sonrisa, un cielo'),(4,28,26,1,'2023-12-26',2,NULL,'Los estados y riqueza,que nos dejen a deshora¿quién lo duda?No les pidamos firmeza,pues que son de una señoraque se muda,que bienes son de Fortuna,que revuelven con su ruedapresurosa,la cual no puede ser una,ni ser estable ni quedaen una cosa.'),(5,34,24,2,'2023-12-22',3,NULL,'allí los ríos caudales,allí los otros medianosy más chicos'),(6,17,22,3,'2023-10-20',0,NULL,'Ponerlo todo en duda es el único modo de ordenarme'),(7,37,27,5,'2023-12-22',2,NULL,'Este mundo bueno fuesi bien usásemos dél,como debemos,porque, según nuestra fe,es para ganar aquelque atendemos.Y aun aquel Hijo de Dios,para subirnos al cielo,descendióa nacer acá entre nosy a vivir en este suelodo murió.'),(8,42,27,NULL,'2023-12-04',2,'sombra','Esta noche al oído me has dicho dos palabrasComunes. Dos palabras cansadasDe ser dichas. Palabras que de viejas son nuevas.Dos palabras tan dulces, que la luna que andabaFiltrando entre las ramasSe detuvo en mi boca. Tan dulces dos palabrasQue una hormiga pasea por mi cuello y no intentoMoverme para echarla.'),(9,45,21,3,'2023-11-20',0,NULL,'Le han dichoCon este hombreno tendrán dóndecaerse muertos.Le he dichotendremostodo el mundodonde pararnos vivos.'),(10,26,25,4,'2023-12-26',1,NULL,'después de tanta hazañaa que no puede bastarcuenta cierta,en la su villa de Ocañavino la Muerte a llamara su puerta'),(11,19,21,2,'2023-09-25',1,NULL,'Por una mirada, un mundo'),(12,40,22,7,'2023-12-22',3,NULL,'En el corazón, quizá, o más exacto:Una herida rasgada con navaja,Por donde se va la vida mal gastada,Con total conciencia nos apuñala.El desear, el querer, el no bastar,Equivocada búsqueda de la razónQue el azar de ser nos justifique,Es eso lo que duele, quizá en el corazón.'),(13,1,8,9,'2023-11-20',2,NULL,'Hay besos que producen desvaríosde amorosa pasión ardiente y loca,tú los conoces bien son besos míosinventados por mí, para tu boca.'),(14,10,15,3,'2023-12-25',3,NULL,'En ventura Octaviano,Julio César en vencery batallar,En la virtud, Africano,Aníbal en el sabery trabajar,En la bondad un Trajano,Tito en liberalidadcon alegría,En su brazo, AurelianoMarco Atilio en la verdadque prometía.'),(15,29,18,13,'2023-03-21',2,NULL,'después de tan bien servidala corona de su reyverdadero'),(16,39,26,2,'2023-12-29',1,NULL,'aquella prosperidadque tan alta fue subiday ensalzada,¿qué fue sino claridad,que cuando más encendidafue matada?'),(17,40,20,14,'2023-10-10',1,NULL,'Tú que en tu divinidadjuntaste cosa tan vilcomo es el hombre'),(18,48,9,NULL,'2023-12-19',2,'el','Tantos duques excelentes,tantos marqueses y condes,y barones,como vimos tan potentes,di, Muerte, ¿dó los escondesy traspones?Y las sus claras hazañasque hicieron en las guerrasy en las paces,cuando tú, cruda, te ensañas,con tu fuerza las atierrasy deshaces.'),(19,43,27,12,'2023-12-22',1,NULL,'Pues su hermano, el inocenteque en su vida sucesorse llamó,¡qué corte tan excelentetuvo y cuánto gran señorque le siguió!Mas como fuese mortal,metiólo la muerte luegoen su fragua,¡oh juicio divinal!Cuando más ardía el fuego,echaste agua.'),(20,30,18,NULL,'2023-12-17',0,'lo','cómo a nuestro parecercualquiera tiempo pasadofue mejor.'),(21,49,15,14,'2023-12-19',2,NULL,'Podrá romperse el eje de la tierraComo un débil cristal.¡todo sucederá! Podrá la muerteCubrirme con su fúnebre crespón'),(22,23,23,16,'2023-06-03',0,NULL,'Si un día despertara sin palabras,moriría de hambre o de tristeza.No tengo nada más: la inútil vocaciónde pensar y explicar lo que he pensado.'),(23,24,17,9,'2023-10-17',4,NULL,'¿Qué se hicieron las damas,sus tocados, sus vestidos,sus olores?¿Qué se hicieron las llamasde los fuegos encendidosde amadores?¿Qué se hizo aquel trovar,las músicas acordadasque tañían?¿Qué se hizo aquel danzar,aquellas ropas chapadasque traían?'),(24,10,26,NULL,'2023-06-23',0,'esa','Aférrate a tus sueñosporque si los sueños muerenla vida es como un pájaro de alas rotasincapaz de volar.Aférrate a tus sueñosporque si los sueños se marchanla vida es como un campo yermocubierto de escarcha.'),(25,47,16,19,'2023-12-22',1,NULL,'lo amocon todas sus debilidadesy me gusta compartir con su terquedadtodo este ancho mundodonde ambos nos somos imprescindibles.'),(26,36,12,23,'2023-09-20',2,NULL,'Si me quieres, quiéreme entera,no por zonas de luz o sombra…Si me quieres, quiéreme negray blanca, Y gris, verde, y rubia,y morena…Quiéreme día,quiéreme noche…¡Y madrugada en la ventana abierta!…Si me quieres, no me recortes:¡Quiéreme toda… O no me quieras!'),(27,30,9,12,'2023-06-29',0,NULL,'Yo no te pido nadayo no te acepto nada.Alcanza con que estésen el mundocon que sepas que estoyen el mundocon que seasme seastestigo juez y diosSi no para qué todo.'),(28,23,7,22,'2023-06-03',0,NULL,'aquella prosperidadque tan alta fue subiday ensalzada,¿qué fue sino claridad,que cuando más encendidafue matada?'),(29,30,19,5,'2023-10-10',1,NULL,'Los estados y riqueza,que nos dejen a deshora¿quién lo duda?No les pidamos firmeza,pues que son de una señoraque se muda,que bienes son de Fortuna,que revuelven con su ruedapresurosa,la cual no puede ser una,ni ser estable ni quedaen una cosa.'),(30,13,14,4,'2023-12-16',3,NULL,'El vivir que es perdurable,no se gana con estadosmundanales,ni con vida deleitable,en que moran los pecadosinfernales,mas los buenos religiosos,ganánlo con oracionesy con lloros,los caballeros famososcon trabajos y afliccionescontra moros.'),(31,12,16,NULL,'2023-12-09',1,'el','Se extingue el díapero no el canto de la alondra'),(32,10,19,20,'2023-12-17',2,NULL,'Las huestes innumerables,los pendones y estandartes,y banderas,los castillos impugnables,los muros y baluartesy barreras,la cava honda chapada,o cualquier otro reparo,¿qué aprovecha?cuando tú vienes airadatodo lo pasas de clarocon tu flecha.'),(33,29,19,NULL,'2023-12-24',1,'donde','des que vemos el engañoy queremos dar la vuelta,no hay lugar.'),(34,12,3,17,'2023-10-10',0,NULL,'¿Qué es poesía?, dices mientras clavasen mi pupila tu pupila azul.¿Qué es poesía? ¿Y tú me lo preguntas?Poesía... eres tú'),(35,3,6,27,'2023-01-22',0,NULL,'Pero digo que, acompañeny lleguen hasta la huesacon su dueño,por eso no nos engañen,pues se va la vida apriesa,como sueño,y los deleites de acáson, en que nos deleitamos,temporales,y los tormentos de allá,que por ellos esperamos,eternales.'),(36,43,4,21,'2023-12-19',0,NULL,'Mi abuelo tiene una cicatriz en el estómago.Mi abuela tiene una cicatriz en el pecho.Mi madre tiene una cicatriz en la garganta.Mi padre tiene una cicatriz en la rodilla.Mi amante tiene una cicatriz en el costado.Mi vida no tiene cicatrices. Solo manchas,aceite, tiempo quemado:un rasguño.'),(37,10,19,NULL,'2023-10-29',2,'es','Aférrate a tus sueñosporque si los sueños muerenla vida es como un pájaro de alas rotasincapaz de volar.Aférrate a tus sueñosporque si los sueños se marchanla vida es como un campo yermocubierto de escarcha.'),(38,4,24,NULL,'2023-10-30',0,'necios.O','En el corazón, quizá, o más exacto:Una herida rasgada con navaja,Por donde se va la vida mal gastada,Con total conciencia nos apuñala.El desear, el querer, el no bastar,Equivocada búsqueda de la razónQue el azar de ser nos justifique,Es eso lo que duele, quizá en el corazón.'),(39,37,1,33,'2023-10-05',0,NULL,'Podrá nublarse el sol eternamente'),(40,19,2,11,'2023-09-25',1,NULL,'no conozco la historia del fuego.'),(41,25,2,21,'2023-06-13',1,NULL,'no curo de sus ficciones,que traen yerbas secretassus sabores.A Aquel sólo me encomiendo,Aquel 