54,'2023-06-27',2,NULL,'Florecen los almendrosen Mallorcay no estás para verlos.De mi balcón anochelos vi fosforecer.Te llamé por tu nombre,conjuré tu fantasma,te perfilé de pétalos caídosy una ráfaga de airete rasgo.'),(69,47,21,44,'2023-11-28',2,NULL,'Si un día despertara sin palabras,moriría de hambre o de tristeza.No tengo nada más: la inútil vocaciónde pensar y explicar lo que he pensado.'),(70,18,12,53,'2023-09-19',1,NULL,'cómo a nuestro parecercualquiera tiempo pasadofue mejor.'),(71,46,25,18,'2021-06-13',1,NULL,'y sabemos que encima de nuestras apariencias,se adivina un saber más allá de las ciencias.Y por eso yo busco el tener a mi ladoel amigo que entienda cuanto digo callado.'),(72,21,14,63,'2023-11-07',2,NULL,'Si un día despertara sin palabras,moriría de hambre o de tristeza.No tengo nada más: la inútil vocaciónde pensar y explicar lo que he pensado.'),(73,3,22,64,'2023-11-24',3,NULL,'El bastón, las monedas, el llavero,la dócil cerradura, las tardíasnotas que no leerán los pocos díasque me quedan, los naipes y el tablero,un libro y en sus páginas la ajadavioleta, monumento de una tardesin duda inolvidable y ya olvidada,el rojo espejo occidental en que ardeuna ilusoria aurora. ¡Cuántas cosas,láminas, umbrales, atlas, copas, clavos,nos sirven como tácitos esclavos,ciegas y extrañamente sigilosas!Durarán más allá de nuestro olvido'),(74,13,8,58,'2023-05-07',2,NULL,'En las noches claras,resuelvo el problema de la soledad del ser.Invito a la luna y con mi sombra somos tres.'),(75,36,9,NULL,'2023-12-20',2,'gentil','mas cumple tener buen tinopara andar esta jornadasin errar.Partimos cuando nacemos,andamos mientras vivimos,y llegamosal tiempo que fenecemos'),(76,15,22,12,'2022-11-05',2,NULL,'Entraban en mi alcoba sin llamar a la puerta,deshojando en el aire la flor de su perfume.Los oía arrastrarse, leves, hasta la alfombra.Trepaban a la cama y luego, entre las sábanas,me anunciaban el día con sutiles caricias.'),(77,37,5,NULL,'2023-11-15',2,'es','Decidme: la he