aravilla que mantiene las estrellas separadasLlevo tu corazón(lo llevo en mi corazon).'),(804,35,23,592,'2020-09-04',1,NULL,'mas cumple tener buen tinopara andar esta jornadasin errar.Partimos cuando nacemos,andamos mientras vivimos,y llegamosal tiempo que fenecemos'),(805,36,22,370,'2023-04-06',0,NULL,'Ahora me regañas porque duermo poco.Me cuentas que en mitad de la noche suspirocomo si tuviera un toro negro en el pechoy que  sumo los ciempiés y las arañas colgantesde los párpados del dormitorio.Me regañas porque no grito las cancionesen el coche, y me ves cansado con ojos chiquititospero tú no sabes qué es la mariposa del insomniorevoloteando sobre un miedotan pulcrotan de estas paredestan resbaladizotan poco poéticocomo es la certidumbrede este ahora que ya fue en incontables ocasiones.'),(806,45,26,740,'2023-09-03',5,NULL,'Pues si vemos lo presentecómo en un punto se es idoy acabado,si juzgamos sabiamente,daremos lo no venidopor pasado.No se engañe nadie, no,pensando que ha de durarlo que esperamás que duró lo que vio,pues que todo ha de pasarpor tal manera.'),(807,20,9,145,'2022-11-16',1,NULL,'vino el pájaroy devoró al gusanovino el hombrey devoró al pájarovino el gusanoy devoró al hombre'),(808,26,17,NULL,'2020-10-10',0,'cabezadesde','Tirar por la borda el último intentosólo para ver si flota...... o se hunde'),(809,9,18,739,'2022-10-26',1,NULL,'tu vida es tu vidano dejes que sea golpeada contra la húmeda sumisiónmantente alertahay salidashay una luz en algún lugarpuede que no sea mucha luz perovence a la oscuridadmantente alertalos dioses te ofrecerán oportunidadesconócelastómalasno puedes vencer a la muerte peropuedes vencer a la muerte en la vida, a vecesy mientras más a menudo aprendas a hacerlomás luz habrátu vida es tu vidaconócela mientras la tengastú eres maravillosolos dioses esperan para deleitarseen tí.'),(810,5,22,70,'2020-11-11',1,NULL,'Tirar por la borda el último intentosólo para ver si flota...... o se hunde'),(811,30,15,NULL,'2022-05-20',2,'es','amar por toda ciencia y amar por todo anhelo.Y cuando la montaña de la vidanos sea dura y larga y alta y llena de abismos,amar la inmensidad que es de amor encendida¡y arder en la fusión de nuestros pechos mismos!'),(812,48,17,616,'2022-02-27',1,NULL,'dejemos a los romanos,aunque oímos y leímossus historias'),(813,24,25,277,'2023-05-18',3,NULL,'diciendo: «Buen caballero,dejad el mundo engañosoy su halago'),(814,28,14,37,'2020-03-10',0,NULL,'Aférrate a tus sueñosporque si los sueños muerenla vida es como un pájaro de alas rotasincapaz de volar.Aférrate a tus sueñosporque si los sueños se marchanla vida es como un campo yermocubierto de escarcha.'),(815,29,2,765,'2023-07-19',0,NULL,'cuán presto se va el placer'),(816,24,27,633,'2020-11-24',1,NULL,'Tantos duques excelentes,tantos marqueses y condes,y barones,como vimos tan potentes,di, Muerte, ¿dó los escondesy traspones?Y las sus claras hazañasque hicieron en las guerrasy en las paces,cuando tú, cruda, te ensañas,con tu fuerza las atierrasy deshaces.'),(817,19,15,338,'2021-11-03',1,NULL,'Estos reyes poderososque vemos por escriturasya pasadas,con casos tristes, llorosos,fueron sus buenas venturastrastornadas.Así que no hay cosa fuerte,que a Papas y Emperadoresy Prelados,así los trata la Muertecomo a los pobres pastoresde ganados.'),(818,5,3,NULL,'2022-08-25',2,'y','Y pues vos, claro varón,tanta sangre derramasteisde paganos,esperad el galardónque en este mundo ganasteispor las manos.Y con esta confianzay con la fe tan enteraque tenéis,partid con buena esperanza,que esta otra vida tercera,ganaréis.»'),(819,27,23,715,'2021-08-18',2,NULL,'vuestro corazón de aceromuestre su esfuerzo famosoen este trago'),(820,16,22,NULL,'2022-11-19',0,'dioses','En el corazón, quizá, o más exacto:Una herida rasgada con navaja,Por donde se va la vida mal gastada,Con total conciencia nos apuñala.El desear, el querer, el no bastar,Equivocada búsqueda de la razónQue el azar de ser nos justifique,Es eso lo que duele, quizá en el corazón.'),(821,47,16,485,'2023-11-25',2,NULL,'Tú que por nuestra maldadtomaste forma servily bajo nombre'),(822,9,1,98,'2021-03-25',2,NULL,'Si vas a intentarlo, ve hasta el final.De otra forma ni siquiera comiences.Si vas a intentarlo, ve hasta el final.Esto puede significar perder novias,esposas,parientes,trabajos y,quizá tu cordura.Ve hasta el final.Esto puede significar no comer por 3 o 4 días.Esto puede significar congelarse en la banca de un parque.Esto puede significar la cárcel.Esto puede significar burlas, escarnios, soledad…La soledad es un regalo.Los demás son una prueba de tu insistencia, ode cuánto quieres realmente hacerlo.Y lo harás,a pesar del rechazo y de las desventajas,y será mejor que cualquier cosa que hayas imaginado.'),(823,33,24,NULL,'2023-05-19',4,'dieron','Pues los otros dos hermanos,maestres tan prosperadoscomo reyes,que a los grandes y medianostrajeron tan sojuzgadosa sus leyes'),(824,6,8,200,'2023-07-24',1,NULL,'Perder todo es fácil,lo difícil es retener algohasta transformarloen una piedra preciosa,en amuleto.'),(825,48,10,NULL,'2023-03-15',3,'estos','Pero creo que mi soledad debería tener alas.'),(826,4,11,NULL,'2023-04-06',1,'vida','Por más que cante un pájaroen el bosque, el ciruelono rompe a florecer'),(827,42,21,781,'2022-04-29',1,NULL,'La amistad es amor en serenos estados.Los amigos se hablan cuando están más callados.si el silencio interrumpe, el amigo respondemi propio pensamiento que también él esconde.Si él comienza prosigo el curso de su idea'),(828,28,14,729,'2023-03-15',0,NULL,'Aquél de buenos abrigo,amado por virtuosode la gente,el Maestre don RodrigoManrique, tanto famosoy tan valiente,sus grandes hechos y clarosno cumple que los alabe,pues los vieron,ni los quiero hacer caros,pues que el mundo todo sabecuáles fueron.'),(829,14,21,NULL,'2022-11-28',1,'unos',' cuando pasen los añosy yo solo sea un hombre que amó,un ser que se detuvo un instante frente a tus labios,un pobre hombre cansado de andar por los jardines,¿dónde estarás tú? ¡Dóndeestarás, oh hija de mis besos!'),(830,9,15,815,'2023-07-19',1,NULL,'¿Mi tierra?Mi tierra eres tú.¿Mi gente?Mi gente eres tú.El destierro y la muertepara mi están adondeno estés tú.¿Y mi vida?Dime, mi vida,¿qué es, si no eres tú?'),(831,19,27,54,'2023-12-24',3,NULL,'Después de puesta la vidatantas veces por su leyal tablero'),(832,14,3,633,'2023-04-21',0,NULL,'Qué vanidad imaginarque puedo darte todo, el amor y la dicha,itinerarios, música, juguetes.Es cierto que es así:todo lo mío te lo doy, es cierto,pero todo lo mío no te bastacomo a mí no me basta que me destodo lo tuyo.Por eso no seremos nuncala pareja perfecta, la tarjeta postal,si no somos capaces de aceptarque sólo en la aritméticael dos nace del uno más el uno.'),(833,29,1,NULL,'2022-01-06',2,'el','En las noches claras,resuelvo el problema de la soledad del ser.Invito a la luna y con mi sombra somos tres.'),(834,23,13,NULL,'2022-08-14',0,'amar','tu vida es tu vidano dejes que sea golpeada contra la húmeda sumisiónmantente alertahay salidashay una luz en algún lugarpuede que no sea mucha luz perovence a la oscuridadmantente alertalos dioses te ofrecerán oportunidadesconócelastómalasno puedes vencer a la muerte peropuedes vencer a la muerte en la vida, a vecesy mientras más a menudo aprendas a hacerlomás luz habrátu vida es tu vidaconócela mientras la tengastú eres maravillosolos dioses esperan para deleitarseen tí.'),(835,38,15,573,'2023-01-09',0,NULL,'Después de puesta la vidatantas veces por su leyal tablero'),(836,5,4,464,'2021-11-18',1,NULL,'Nuestras vidas son los ríosque van a dar en la mar,que es el morir:allí van los señoríos,derechos a se acabary consumir'),(837,42,19,208,'2021-04-22',0,NULL,'No todo es días de soly la lluvia cuando falta mucho, se pide.Por eso tomo la infelicidad con la felicidad.Naturalmente como quien no se extrañacon que existan montañas y planicies y que haya rocas y hierbas…Lo que es necesario es ser natural y calmado en la felicidad o en lainfelicidad.'),(838,22,18,206,'2022-09-07',2,NULL,'Después de puesta la vidatantas veces por su leyal tablero'),(839,7,19,812,'2022-02-27',2,NULL,'¡Qué amigo de sus amigos!,¡qué señor para criadosy parientes!,¡qué enemigo de enemigos!,¡qué maestre de esforzadosy valientes!,¡qué seso para discretos!,¡qué gracia para donosos!,¡qué razón!,¡cuán benigno a los sujetos!,y a los bravos y dañosos,¡qué león!'),(840,5,18,439,'2023-08-02',1,NULL,'Tantos duques excelentes,tantos marqueses y condes,y barones,como vimos tan potentes,di, Muerte, ¿dó los escondesy traspones?Y las sus claras hazañasque hicieron en las guerrasy en las paces,cuando tú, cruda, te ensañas,con tu fuerza las atierrasy deshaces.'),(841,43,9,174,'2023-10-22',2,NULL,'La tierra ensucia las manospero limpia al hombre.'),(842,30,22,686,'2023-03-08',2,NULL,'Si un día despertara sin palabras,moriría de hambre o de tristeza.No tengo nada más: la inútil vocaciónde pensar y explicar lo que he pensado.'),(843,34,24,389,'2023-12-20',2,NULL,'Y pues vos, claro varón,tanta sangre derramasteisde paganos,esperad el galardónque en este mundo ganasteispor las manos.Y con esta confianzay con la fe tan enteraque tenéis,partid con buena esperanza,que esta otra vida tercera,ganaréis.»'),(844,41,2,NULL,'2021-12-22',0,'el','Florecen los almendrosen Mallorcay no estás para verlos.De mi balcón anochelos vi fosforecer.Te llamé por tu nombre,conjuré tu fantasma,te perfilé de pétalos caídosy una ráfaga de airete rasgo.'),(845,41,24,196,'2023-12-13',2,NULL,'que crece mas alto de lo que el alma pueda esperar… o la mente ocultar)Es la maravilla que mantiene las estrellas separadasLlevo tu corazón(lo llevo en mi corazon).'),(846,26,11,NULL,'2021-04-16',2,'dicha','que crece mas alto de lo que el alma pueda esperar… o la mente ocultar)Es la maravilla que mantiene las estrellas separadasLlevo tu corazón(lo llevo en mi corazon).'),(847,24,5,819,'2020-03-06',2,NULL,'Yo no hablo de venganzas ni de perdones'),(848,12,19,NULL,'2020-07-05',1,'brota','Si vas a intentarlo, ve hasta