ás el uno.'),(868,4,1,594,'2023-07-20',2,NULL,'Aquél de buenos abrigo,amado por virtuosode la gente,el Maestre don RodrigoManrique, tanto famosoy tan valiente,sus grandes hechos y clarosno cumple que los alabe,pues los vieron,ni los quiero hacer caros,pues que el mundo todo sabecuáles fueron.'),(869,8,15,NULL,'2023-03-07',2,'soly','El vivir que es perdurable,no se gana con estadosmundanales,ni con vida deleitable,en que moran los pecadosinfernales,mas los buenos religiosos,ganánlo con oracionesy con lloros,los caballeros famososcon trabajos y afliccionescontra moros.'),(870,12,27,514,'2022-09-01',2,NULL,'Si la vida es amor, ¡bendita sea!¡Quiero más vida para amar! Hoy sientoQue no valen mil años de la ideaLo que un minuto azul de sentimiento.Mi corazón moría triste y lento...Hoy abre en luz como una flor febea'),(871,50,24,576,'2022-08-05',1,NULL,'Mi abuelo tiene una cicatriz en el estómago.Mi abuela tiene una cicatriz en el pecho.Mi madre tiene una cicatriz en la garganta.Mi padre tiene una cicatriz en la rodilla.Mi amante tiene una cicatriz en el costado.Mi vida no tiene cicatrices. Solo manchas,aceite, tiempo quemado:un rasguño.'),(872,47,20,18,'2023-04-20',2,NULL,'o si, siendo engañado, no respondes con engaños,o si, siendo odiado, no incurres en el odio.Y aun así no te las das de bueno ni de sabio.Si puedes soñar sin que los sueños te dominen'),(873,6,8,420,'2022-04-11',1,NULL,'vuestro corazón de aceromuestre su esfuerzo famosoen este trago'),(874,5,9,101,'2023-10-26',2,NULL,'no curo de sus ficciones,que traen yerbas secretassus sabores.A Aquel sólo me encomiendo,Aquel sólo invoco yode verdad,que, en este mundo viviendo,el mundo no conociósu deidad.'),(875,21,14,176,'2021-02-02',1,NULL,'Perder todo es fácil,lo difícil es retener algohasta transformarloen una piedra preciosa,en amuleto.'),(876,28,14,NULL,'2021-07-14',1,'hay','vengamos a lo de ayer,que también es olvidadocomo aquello.'),(877,38,1,NULL,'2022-03-29',1,'arena.Polvo','Te hace una seña con la cabezadesde esa niebla de luz. Sonríe.Que sí, que ahorita vuelve.Miras sus gestos, su lejanía,pero no la escuchas. Polvode niebla es la arena.Polvo ficticio el mar.Desde más lejos, frente a ese brilloque lo corta te mira,te hace señas. Que sí, que ahorita vuelve.Que ahorita vuelve.'),(878,10,14,448,'2022-12-01',3,NULL,'¿Qué se hizo el rey don Juan?Los infantes de Aragón¿qué se hicieron?¿Qué fue de tanto galán,qué fue de tanta invencióncomo trujeron?Las justas y los torneos,paramentos, bordaduras,y cimeras,¿fueron sino devaneos?¿Qué fueron sino verdurasde las eras?'),(879,3,10,NULL,'2023-09-10',3,'caminar','El Amor - es anterior a la Vida -posterior - a la Muerte -inicial de la Creación, yde la tierra el Exponente -'),(880,21,3,497,'2023-09-12',3,NULL,'La tierra - por los Mares navegados.El Éxtasis - por el tormento-La Paz - por el recuento de sus batallas-El Amor, por el Moho de la Memoria-Por la Nieve, los Pájaros.'),(881,31,13,NULL,'2021-08-29',3,'está','Si un día despertara sin palabras,moriría de hambre o de tristeza.No tengo nada más: la inútil vocaciónde pensar y explicar lo que he pensado.'),(882,12,23,280,'2021-02-01',1,NULL,'Perder todo es fácil,lo difícil es retener algohasta transformarloen una piedra preciosa,en amuleto.'),(883,20,23,372,'2023-10-18',1,NULL,'En las noches claras,resuelvo el problema de la soledad del ser.Invito a la luna y con mi sombra somos tres.'),(884,44,24,656,'2023-03-04',2,NULL,'Pero jamás en mí podrá apagarseLa llama de tu amor.'),(885,42,19,659,'2020-03-03',1,NULL,'allí los ríos caudales,allí los otros medianosy más chicos'),(886,28,19,877,'2020-12-19',1,NULL,'Pues aquel gran CondestableMaestre que conocimos,tan privado,no cumple que dél se hable,sino sólo que lo vimosdegollado.Sus infinitos tesoros,sus villas y sus lugares,su mandar,¿qué le fueron sino lloros?¿que fueron sino pesaresal dejar?'),(887,29,10,NULL,'2020-02-08',1,'tu','Aférrate a tus sueñosporque si los sueños muerenla vida es como un pájaro de alas rotasincapaz de volar.Aférrate a tus sueñosporque si los sueños se marchanla vida es como un campo yermocubierto de escarcha.'),(888,22,16,561,'2023-01-03',4,NULL,'Nosotros, desacostumbrados al valorexiliados del placerenroscados en la caparazón de la soledadhasta que el amor baja de su templo sagradoy se presenta ante nuestros ojospara liberarnos a la vida.Llega el amory en su tren vienen éxtasisviejos recuerdos de gozoantiguas historias de dolor.Y si somos audaces,el amor arranca de nuestras almaslas cadenas del miedo.Al calor de la luz del amorabandonamos nuestra timideznos atrevemos a ser valientesY de pronto vemos que el amornos cuesta todo lo que somosy todo lo que podemos ser.Y sin embargo es el amorlo único que nos libera.'),(889,35,23,176,'2022-10-14',1,NULL,'vino el pájaroy devoró al gusanovino el hombrey devoró al pájarovino el gusanoy devoró al hombre'),(890,47,21,NULL,'2023-08-16',4,'virtuosode','Ponerlo todo en duda es el único modo de ordenarme'),(891,45,23,NULL,'2021-08-12',3,'y','Pues el otro, su heredero,don Enrique, ¡qué poderesalcanzaba!¡Cuán blando, cuán halagueroel mundo con sus placeresse le daba!Mas verás cuán enemigo,cuán contrario, cuán cruelse le mostró,habiéndole sido amigo,¡cuán poco duró con éllo que le dio!'),(892,5,24,32,'2023-12-17',3,NULL,'La gentil delicadeza del guiño añadidoque convierte la flaqueza en la fuerza y ligerezapara la alegría en pobreza y el cuerpo dolido.Y sí, a veces sobra la palabra y su sobrevalorado poder escrito.Mejor no dar por hecho y consumir el hecho.Mejor una caricia a una receta.Mejor un gesto a un charlatán rocambolesco.Mejor lo sutil que su hijo tonto el denso.'),(893,23,21,244,'2022-07-03',0,NULL,'¿Qué se hicieron las damas,sus tocados, sus vestidos,sus olores?¿Qué se hicieron las llamasde los fuegos encendidosde amadores?¿Qué se hizo aquel trovar,las músicas acordadasque tañían?¿Qué se hizo aquel danzar,aquellas ropas chapadasque traían?'),(894,43,25,694,'2023-08-23',3,NULL,'no sabrán nunca que nos hemos ido.'),(895,14,8,398,'2021-08-30',3,NULL,'El Agua se conoce por la sed'),(896,26,24,NULL,'2021-02-21',1,'caricias.;¿Qué','No dejó grandes tesoros,ni alcanzó muchas riquezas,ni vajillas,mas hizo guerra a los moros,ganando sus fortalezasy sus villas.Y en las lides que venció,muchos moros y caballosse perdieron,y en este oficio ganólas rentas y los vasallosque le dieron.'),(897,33,11,602,'2020-04-06',2,NULL,'Te hace una seña con la cabezadesde esa niebla de luz. Sonríe.Que sí, que ahorita vuelve.Miras sus gestos, su lejanía,pero no la escuchas. Polvode niebla es la arena.Polvo ficticio el mar.Desde más lejos, frente a ese brilloque lo corta te mira,te hace señas. Que sí, que ahorita vuelve.Que ahorita vuelve.'),(898,21,20,608,'2023-01-11',0,NULL,'Pues aquel gran CondestableMaestre que conocimos,tan privado,no cumple que dél se hable,sino sólo que lo vimosdegollado.Sus infinitos tesoros,sus villas y sus lugares,su mandar,¿qué le fueron sino lloros?¿que fueron sino pesaresal dejar?'),(899,47,10,122,'2020-11-18',2,NULL,'Estar enamorado, amigos, es encontrarel nombre justo a la vida.Es dar al fin con las palabras que para hacerfrente a la muerte se precisa.Es recobrar la llave oculta que abre la cárcelen que el alma está cautiva.Es levantarse de la tierra con una fuerza quereclama desde arriba.Es respirar el ancho viento que por encima dela carne respira.Es contemplar, desde la cumbre de la persona,la razón de las heridas.Es advertir en unos ojos una mirada verdaderaque nos mira.Es escuchar en una boca la propia vozprofundamente repetida.Es sorprender en unas manos ese calor de laperfecta compañía.Es sospechar que, para siempre, la soledadde nuestra sombra está vencida.'),(900,19,25,283,'2023-08-06',0,NULL,'En ventura Octaviano,Julio César en vencery batallar,En la virtud, Africano,Aníbal en el sabery trabajar,En la bondad un Trajano,Tito en liberalidadcon alegría,En su brazo, AurelianoMarco Atilio en la verdadque prometía.'),(901,41,6,478,'2023-04-18',0,NULL,'Pues si vemos lo presentecómo en un punto se es idoy acabado,si juzgamos sabiamente,daremos lo no venidopor pasado.No se engañe nadie, no,pensando que ha de durarlo que esperamás que duró lo que vio,pues que todo ha de pasarpor tal manera.'),(902,50,9,32,'2020-01-07',5,NULL,'Si puedes mantener la cabeza en su sitio cuando todos a tu alrededorla pierden y te culpan a ti.Si puedes seguir creyendo en ti mismo cuando todos dudan de ti,pero también aceptas que tengan dudas.Si puedes esperar y no cansarte de la espera'),(903,26,12,NULL,'2022-09-08',1,'la','No se me importa un pito que las mujerestengan los senos como magnolias o como pasas de higo'),(904,19,23,90,'2023-01-24',0,NULL,'Pues su hermano, el inocenteque en su vida sucesorse llamó,¡qué corte tan excelentetuvo y cuánto gran señorque le siguió!Mas como fuese mortal,metiólo la muerte luegoen su fragua,¡oh juicio divinal!Cuando más ardía el fuego,echaste agua.'),(905,10,15,NULL,'2023-05-24',3,'por','¿Deseas que te amen? No pierdas, pues,El rumbo de tu corazón.Sólo aquello que eres has de serY aquello que no eres, no.Así, en el mundo, tu modo sutil,Tu gracia, tu bellísimo ser,Serán objeto de elogio sin finY el amor... un sencillo deber.'),(906,6,16,187,'2020-01-05',0,NULL,'Mi táctica esmirarteaprender como sosquererte como sosmi táctica eshablartey escucharteconstruir con palabrasun puente indestructiblemi táctica esquedarme en tu recuerdono sé cómoni sécon qué pretextopero quedarme en vosmi táctica esser francoy saber que sos francay que no nos vendamossimulacrospara que entre los dosno haya telónni abismosmi estrategia esen cambiomás profunda y mássimplemi estrategia esque un día cualquierano sé cómoni sécon qué pretextopor finme necesites.'),(907,5,2,528,'2020-09-01',0,NULL,'Si me quieres, quiéreme entera,no por zonas de luz o sombra…Si me quieres, quiéreme negray blanca, Y gris, verde, y rubia,y morena…Quiéreme día,quiéreme noche…¡Y madrugada en la ventana abierta!…Si me quieres, no me recortes:¡Quiéreme toda… O no me quieras!'),(908,40,15,NULL,'2021-12-25',1,'recuerdos','Por una mirada, un mundo'),(909,29,4,455,'2022-04-25',4,NULL,'Y donde aquello que hago yo soloes gracias a ti, mi cielo).No le temo al destino(ya que tu eres mi destino, cariño).No quiero ningún mundo (porque hermosatu eres mi mundo, mi bien).Este es el secreto más profundo que nadie conoce…(Esta es la raíz de la raízy el brote del brotey el cielo del cielo de un árbol llamado vida'),(910,12,11,131,'2020-09-08',1,NULL,'Entraban en mi alcoba sin llamar a la puerta,deshojando en el aire la flor de su perfume.Los oía arrastrarse, leves, hasta la alfombra.Trepaban a la cama y luego, entre las sábanas,me anunciaban el día con sutiles caricias.'),(911,7,7,NULL,'2023-10-22',1,'dioses','Así, con tal entender,todos sentidos humanosconservados,cercado de su mujer,Y de sus hijos y hermanosy criados,dio el alma a quien se la dio,el cual la ponga en el cieloy en su gloria,y aunque la vida perdió,dejónos harto consuelosu memoria.'),(912,6,17,NULL,'2023-01-10',2,'nos','no sabrán nunca que nos hemos ido.'),(913,11,9,157,'2021-10-13',3,NULL,'no conozco la historia del fuego.'),(914,50,4,76,'2021-02-10',1,NULL,'Las dádivas desmedidas,los edificios realesllenos de oro,las vajillas tan fabridas,los enriques y realesdel tesoro,los jaeces y caballosde su gente, y atavíostan sobrados,¿dónde iremos a buscallos?¿qué fueron sino rocíosde los prados?'),(915,31,19,631,'2022-06-02',3,NULL,'No todo es días de soly la lluvia cuando falta mucho, se pide.Por eso tomo la infelicidad con la felicidad.Naturalmente como quien no se extrañacon que existan montañas y planicies y que haya rocas y hierbas…Lo que es necesario es ser natural y calmado en la felicidad o en lainfelicidad.'),(916,12,23,NULL,'2020-11-18',4,'devoró','Podrá romperse el eje de la tierraComo un débil cristal.¡todo sucederá! Podrá la muerteCubrirme con su fúnebre crespón'),(917,3,24,748,'2021-06-11',0,NULL,'La esperanza es esa cosa con plumasque se posa en el alma,y entona melodías sin palabras,y no se detiene para nada'),(918,9,20,NULL,'2022-05-18',4,'nada','Ponerlo todo en duda es el único modo de ordenarme'),(919,29,22,406,'2023-06-02',3,NULL,'Pues si vemos lo presentecómo en un punto se es idoy acabado,si juzgamos sabiamente,daremos lo no venidopor pasado.No se engañe nadie, no,pensando que ha de durarlo que esperamás que duró lo que vio,pues que todo ha de pasarpor tal manera.'),(920,37,19,NULL,'2023-08-07',3,'ha','Pero creo que mi soledad debería tener alas.'),(921,19,19,NULL,'2023-12-29',3,'quizá,','amar por toda ciencia y amar por todo anhelo.Y cuando la montaña de la vidanos sea dura y larga y alta y llena de abismos,amar la inmensidad que es de amor encendida¡y arder en la fusión de nuestros pechos mismos!'),(922,28,6,311,'2020-01-06',1,NULL,'¡Qué amigo de sus amigos!,¡qué señor para criadosy parientes!,¡qué enemigo de enemigos!,¡qué maestre de esforzadosy valientes!,¡qué seso para discretos!,¡qué gracia para donosos!,¡qué razón!,¡cuán benigno a los sujetos!,y a los bravos y dañosos,¡qué león!'),(923,18,27,279,'2022-05-23',1,NULL,'Amar, amar, amar, amar siempre, con todoel ser y con la tierra y con el cielo,con lo claro del sol y lo oscuro del lodo:Amar por toda ciencia y amar por todo anhelo.Y cuando la montaña de la vidanos sea dura y larga y alta y llena de abismos,Amar la inmensidad que es de amor encendida¡y arder en la fusión de nuestros pechos mismos!'),(924,20,19,500,'2023-07-23',1,NULL,'Así, con tal entender,todos sentidos humanosconservados,cercado de su mujer,Y de sus hijos y hermanosy criados,dio el alma a quien se la dio,el cual la ponga en el cieloy en su gloria,y aunque la vida perdió,dejónos harto consuelosu memoria.'),(925,8,1,219,'2020-05-23',4,NULL,'o si, siendo engañado, no respondes con engaños,o si, siendo odiado, no incurres en el odio.Y aun así no te las das de bueno ni de sabio.Si puedes soñar sin que los sueños te dominen'),(926,14,20,73,'2020-02-11',0,NULL,'Érase una vezun lobito buenoal que maltratabantodos los corderos.Y había tambiénun príncipe malo,una bruja hermosay un pirata honrado.Todas estas cosashabía una vezcuando yo soñabaun mundo al revés.'),(927,7,4,739,'2022-12-05',1,NULL,'no curemos de saberlo de aquel siglo pasado,qué fue de ello'),(928,29,19,123,'2020-05-22',3,NULL,'Las huestes innumerables,los pendones y estandartes,y banderas,los castillos impugnables,los muros y baluartesy barreras,la cava honda chapada,o cualquier otro reparo,¿qué aprovecha?cuando tú vienes airadatodo lo pasas de clarocon tu flecha.'),(929,30,20,127,'2021-11-22',0,NULL,'Érase una vezun lobito buenoal que maltratabantodos los corderos.Y había tambiénun príncipe malo,una bruja hermosay un pirata honrado.Todas estas cosashabía una vezcuando yo soñabaun mundo al revés.'),(930,39,9,687,'2022-08-11',2,NULL,'des que vemos el engañoy queremos dar la vuelta,no hay lugar.'),(931,50,14,113,'2021-08-01',3,NULL,'Tú que tan grandes tormentossufriste sin resistenciaen tu persona,no por mis merecimientos,mas por tu sola clemencia,me perdona.'),(932,13,15,883,'2023-02-16',0,NULL,'y pues de vida y saludhicisteis tan poca cuentapor la fama,esfuércese la virtudpor sufrir esta afrentaque os llama.'),(933,38,16,247,'2023-10-09',0,NULL,'Te regalo este abrazo de floresque desde ahora rodea tu cinturaLo he labrado con lo más frescode mis pensamientosCon el inmenso amorque otras tal vez querríanDe mí / de ti depende que reluzcaQue no se extinga su brilloSu lenguaje.'),(934,20,7,157,'2020-06-14',0,NULL,'Amar, amar, amar, amar siempre, con todoel ser y con la tierra y con el cielo,con lo claro del sol y lo oscuro del lodo'),(935,22,3,NULL,'2022-10-29',3,'en','¿Deseas que te amen? No pierdas, pues,El rumbo de tu corazón.Sólo aquello que eres has de serY aquello que no eres, no.Así, en el mundo, tu modo sutil,Tu gracia, tu bellísimo ser,Serán objeto de elogio sin finY el amor... un sencillo deber.'),(936,37,21,805,'2023-04-06',1,NULL,'Este mundo bueno fuesi bien usásemos dél,como debemos,porque, según nuestra fe,es para ganar aquelque atendemos.Y aun aquel Hijo de Dios,para subirnos al cielo,descendióa nacer acá entre nosy a vivir en este suelodo murió.'),(937,38,13,517,'2023-09-10',1,NULL,'En las noches claras,resuelvo el problema de la soledad del ser.Invito a la luna y con mi sombra somos tres.'),(938,9,7,707,'2022-12-24',4,NULL,'El vivir que es perdurable,no se gana con estadosmundanales,ni con vida deleitable,en que moran los pecadosinfernales,mas los buenos religiosos,ganánlo con oracionesy con lloros,los caballeros famososcon trabajos y afliccionescontra moros.'),(939,31,21,NULL,'2023-11-29',0,'forma','No se me importa un pito que las mujerestengan los senos como magnolias o como pasas de higo'),(940,3,14,324,'2023-05-14',1,NULL,'cómo a nuestro parecercualquiera tiempo pasadofue mejor.'),(941,25,26,418,'2022-06-20',0,NULL,'No se os haga tan amargala batalla temerosaque esperáis,pues otra vida más largade fama tan gloriosaacá dejáis.Aunque esta vida de honortampoco no es eternal,ni verdadera,mas, con todo, es muy mejorque la vida terrenal,perecedera.'),(942,9,24,568,'2022-08-22',0,NULL,'Podrá romperse el eje de la tierraComo un débil cristal.¡todo sucederá! Podrá la muerteCubrirme con su fúnebre crespón'),(943,9,1,821,'2023-11-25',1,NULL,'y pues de vida y saludhicisteis tan poca cuentapor la fama,esfuércese la virtudpor sufrir esta afrentaque os llama.'),(944,45,9,700,'2022-11-15',2,NULL,'Este mundo bueno fuesi bien usásemos dél,como debemos,porque, según nuestra fe,es para ganar aquelque atendemos.Y aun aquel Hijo de Dios,para subirnos al cielo,descendióa nacer acá entre nosy a vivir en este suelodo murió.'),(945,12,12,152,'2023-10-30',0,NULL,'así que, cuando morimos,descansamos.'),(946,37,18,735,'2020-04-03',0,NULL,'Tú que por nuestra maldadtomaste forma servily bajo nombre'),(947,47,4,892,'2021-12-28',2,NULL,'¿Qué se hicieron las damas,sus tocados, sus vestidos,sus olores?¿Qué se hicieron las llamasde los fuegos encendidosde amadores?¿Qué se hizo aquel trovar,las músicas acordadasque tañían?¿Qué se hizo aquel danzar,aquellas ropas chapadasque traían?'),(948,25,10,NULL,'2021-03-03',2,'maravillosolos','Lo queramos o noSólo tenemos tres alternativas:El ayer, el presente y el mañana.Y ni siquiera tresPorque como dice el filósofoEl ayer es ayerNos pertenece sólo en el recuerdo:A la rosa que ya se deshojóNo se le puede sacar otro pétalo.Las cartas por jugarSon solamente dos:El presente y el día de mañana.Y ni siquiera dosPorque es un hecho bien establecidoQue el presente no existeSino en la medida en que se hace pasadoY ya pasó...,como la juventud.En resumidas cuentasSólo nos va quedando el mañana:Yo levanto mi copaPor ese día que no llega nuncaPero que es lo únicoDe lo que realmente disponemos.'),(949,23,19,NULL,'2022-10-25',1,'reparadora.;El','Pues si vemos lo presentecómo en un punto se es idoy acabado,si juzgamos sabiamente,daremos lo no venidopor pasado.No se engañe nadie, no,pensando que ha de durarlo que esperamás que duró lo que vio,pues que todo ha de pasarpor tal manera.'),(950,29,23,305,'2023-10-07',0,NULL,'así que, cuando morimos,descansamos.'),(951,2,7,588,'2022-09-03',2,NULL,'Tú que en tu divinidadjuntaste cosa tan vilcomo es el hombre'),(952,38,7,236,'2023-11-19',0,NULL,'Así, con tal entender,todos sentidos humanosconservados,cercado de su mujer,Y de sus hijos y hermanosy criados,dio el alma a quien se la dio,el cual la ponga en el cieloy en su gloria,y aunque la vida perdió,dejónos harto consuelosu memoria.'),(953,12,5,760,'2022-07-26',3,NULL,'mas cumple tener buen tinopara andar esta jornadasin errar.Partimos cuando nacemos,andamos mientras vivimos,y llegamosal tiempo que fenecemos'),(954,15,2,NULL,'2023-07-25',3,'alta','Y donde aquello que hago yo soloes gracias a ti, mi cielo).No le temo al destino(ya que tu eres mi destino, cariño).No quiero ningún mundo (porque hermosatu eres mi mundo, mi bien).Este es el secreto más profundo que nadie conoce…(Esta es la raíz de la raízy el brote del brotey el cielo del cielo de un árbol llamado vida'),(955,24,6,849,'2023-02-04',1,NULL,'Hay cosas peores queestar solopero a menudo toma décadasdarse cuenta de elloy más a menudocuando esto ocurrees demasiado tardey no hay nada peorqueun demasiado tarde.'),(956,29,12,73,'2023-11-24',1,NULL,'No se me importa un pito que las mujerestengan los senos como magnolias o como pasas de higo'),(957,17,14,365,'2022-12-19',2,NULL,'En lo más adentro, en nuestros abismos,Ahí se encuentran las verdades asfixiadasPor la cobardía.'),(958,14,2,NULL,'2021-12-18',0,'chiquititospero','Tú que tan grandes tormentossufriste sin resistenciaen tu persona,no por mis merecimientos,mas por tu sola clemencia,me perdona.'),(959,38,5,NULL,'2022-12-12',2,'el','La tierra - por los Mares navegados.El Éxtasis - por el tormento-La Paz - por el recuento de sus batallas-El Amor, por el Moho de la Memoria-Por la Nieve, los Pájaros.'),(960,49,26,956,'2020-11-23',1,NULL,'Hoy me he arrepentidode todas las tormentas de veranoen las que me puse a cubierto.'),(961,47,20,641,'2020-06-29',0,NULL,'Te hace una seña con la cabezadesde esa niebla de luz. Sonríe.Que sí, que ahorita vuelve.Miras sus gestos, su lejanía,pero no la escuchas. Polvode niebla es la arena.Polvo ficticio el mar.Desde más lejos, frente a ese brilloque lo corta te mira,te hace señas. Que sí, que ahorita vuelve.Que ahorita vuelve.'),(962,41,10,627,'2021-08-21',0,NULL,'Hoy me he arrepentidode todas las tormentas de veranoen las que me puse a cubierto.'),(963,18,4,489,'2022-10-06',4,NULL,'no sabrán nunca que nos hemos ido.'),(964,21,7,106,'2021-08-01',1,NULL,'Si vas a intentarlo, ve hasta el final.De otra forma ni siquiera comiences.Si vas a intentarlo, ve hasta el final.Esto puede significar perder novias,esposas,parientes,trabajos y,quizá tu cordura.Ve hasta el final.Esto puede significar no comer por 3 o 4 días.Esto puede significar congelarse en la banca de un parque.Esto puede significar la cárcel.Esto puede significar burlas, escarnios, soledad…La soledad es un regalo.Los demás son una prueba de tu insistencia, ode cuánto quieres realmente hacerlo.Y lo harás,a pesar del rechazo y de las desventajas,y será mejor que cualquier cosa que hayas imaginado.'),(965,35,10,303,'2021-07-10',4,NULL,'Podrá secarse en un instante el mar'),(966,44,22,641,'2023-06-26',3,NULL,'Pues aquel gran CondestableMaestre que conocimos,tan privado,no cumple que dél se hable,sino sólo que lo vimosdegollado.Sus infinitos tesoros,sus villas y sus lugares,su mandar,¿qué le fueron sino lloros?¿que fueron sino pesaresal dejar?'),(967,45,22,668,'2023-07-07',2,NULL,'Pues su hermano, el inocenteque en su vida sucesorse llamó,¡qué corte tan excelentetuvo y cuánto gran señorque le siguió!Mas como fuese mortal,metiólo la muerte luegoen su fragua,¡oh juicio divinal!Cuando más ardía el fuego,echaste agua.'),(968,4,6,99,'2022-04-20',2,NULL,'o si, siendo engañado, no respondes con engaños,o si, siendo odiado, no incurres en el odio.Y aun así no te las das de bueno ni de sabio.Si puedes soñar sin que los sueños te dominen'),(969,46,18,813,'2023-05-18',3,NULL,'allí los ríos caudales,allí los otros medianosy más chicos'),(970,19,9,835,'2023-01-09',3,NULL,'Decidme: la hermosura,la gentil frescura y tezde la cara,la color y la blancura,cuando viene la vejez¿cuál se para?Las mañas y ligerezay la fuerza corporalde juventud,todo se torna gravezacuando llega al arrabalde senectud.'),(971,28,6,NULL,'2020-03-13',2,'vemos','Tú que por nuestra maldadtomaste forma servily bajo nombre'),(972,1,9,894,'2023-08-23',1,NULL,'Hoy me he arrepentidode todas las tormentas de veranoen las que me puse a cubierto.'),(973,40,10,NULL,'2023-08-15',0,'vasta,','lo amocon todas sus debilidadesy me gusta compartir con su terquedadtodo este ancho mundodonde ambos nos somos imprescindibles.'),(974,28,4,182,'2021-04-23',1,NULL,'si puedes pensar y no hacer de tus pensamientos tu único objetivo'),(975,50,2,540,'2022-11-20',2,NULL,'Las dádivas desmedidas,los edificios realesllenos de oro,las vajillas tan fabridas,los enriques y realesdel tesoro,los jaeces y caballosde su gente, y atavíostan sobrados,¿dónde iremos a buscallos?¿qué fueron sino rocíosde los prados?'),(976,3,27,811,'2022-05-20',1,NULL,'Los estados y riqueza,que nos dejen a deshora¿quién lo duda?No les pidamos firmeza,pues que son de una señoraque se muda,que bienes son de Fortuna,que revuelven con su ruedapresurosa,la cual no puede ser una,ni ser estable ni quedaen una cosa.'),(977,40,24,372,'2020-11-12',1,NULL,'Yo no te pido nadayo no te acepto nada.Alcanza con que estésen el mundocon que sepas que estoyen el mundocon que seasme seastestigo juez y diosSi no para qué todo.'),(978,2,23,709,'2021-06-27',0,NULL,'Juventud, vasta, lozana, amorosa'),(979,10,1,563,'2020-04-10',1,NULL,'Ved de cuán poco valorson las cosas tras que andamosy corremos,que en este mundo traidoraun primero que muramoslas perdemos.De ellas deshace la edad,de ellas casos desastradosque acaecen,de ellas, por su calidad,en los más altos estadosdesfallecen.'),(980,18,14,135,'2021-11-20',0,NULL,'El vivir que es perdurable,no se gana con estadosmundanales,ni con vida deleitable,en que moran los pecadosinfernales,mas los buenos religiosos,ganánlo con oracionesy con lloros,los caballeros famososcon trabajos y afliccionescontra moros.'),(981,18,6,141,'2021-09-24',0,NULL,'un cutis de durazno o de papel de lija.Le doy una importancia igual a cero,al hecho de que amanezcan con un aliento afrodisíacoo con un aliento insecticida.Soy perfectamente capaz de soportarlesuna nariz que sacaría el primer premioen una exposición de zanahorias'),(982,41,18,543,'2021-04-20',2,NULL,'Sé de ciencia ciertaque el amores mejor que las multi-vitaminas,que la pareja humanaes el principio inevitable de la vida,que por eso no quiero jamás liberarme del hombre'),(983,39,19,880,'2023-05-19',1,NULL,'Y donde aquello que hago yo soloes gracias a ti, mi cielo).No le temo al destino(ya que tu eres mi destino, cariño).No quiero ningún mundo (porque hermosatu eres mi mundo, mi bien).Este es el secreto más profundo que nadie conoce…(Esta es la raíz de la raízy el brote del brotey el cielo del cielo de un árbol llamado vida'),(984,29,17,65,'2023-10-20',1,NULL,'Si puedes mantener la cabeza en su sitio cuando todos a tu alrededorla pierden y te culpan a ti.Si puedes seguir creyendo en ti mismo cuando todos dudan de ti,pero también aceptas que tengan dudas.Si puedes esperar y no cansarte de la espera'),(985,12,24,NULL,'2022-10-04',2,'a','si puedes encontrarte con el triunfo y el fracaso,y tratar a esos dos impostores de la misma manera.Si puedes soportar oír la verdad que has dicho,tergiversada por villanos para engañar a los necios.O ver cómo se destruye todo aquello por lo que has dado la vida,y remangarte para reconstruirlo con herramientas desgastadas.Si puedes apilar todas tus gananciasy arriesgarlas a una sola jugada'),(986,4,1,509,'2021-07-04',1,NULL,' juventud llena de gracia,fuerza y fascinación.¿Sabes que la Vejez puede venir en pos de ti con la misma gracia,fuerza y fascinación?Día florido y espléndido, día en que brilla un sol inmenso, díade acción, ambición y risa.La Noche te sigue de cerca con un millón de soles, y sueño, yuna oscuridad reparadora.'),(987,47,2,467,'2023-11-20',0,NULL,'Si vas a intentarlo, ve hasta el final.De otra forma ni siquiera comiences.Si vas a intentarlo, ve hasta el final.Esto puede significar perder novias,esposas,parientes,trabajos y,quizá tu cordura.Ve hasta el final.Esto puede significar no comer por 3 o 4 días.Esto puede significar congelarse en la banca de un parque.Esto puede significar la cárcel.Esto puede significar burlas, escarnios, soledad…La soledad es un regalo.Los demás son una prueba de tu insistencia, ode cuánto quieres realmente hacerlo.Y lo harás,a pesar del rechazo y de las desventajas,y será mejor que cualquier cosa que hayas imaginado.'),(988,11,14,NULL,'2022-05-02',3,'costadoY','Pero jamás en mí podrá apagarseLa llama de tu amor.'),(989,46,23,NULL,'2021-05-02',1,'se','cómo a nuestro parecercualquiera tiempo pasadofue mejor.'),(990,16,22,986,'2021-07-04',2,NULL,'Alejarse cuenta como amor, amor a la vida,amor a estar bien,amor a no pensar más,amor a uno mismo.Amor propio.'),(991,3,5,452,'2021-01-16',2,NULL,'Qué vanidad imaginarque puedo darte todo, el amor y la dicha,itinerarios, música, juguetes.Es cierto que es así:todo lo mío te lo doy, es cierto,pero todo lo mío no te bastacomo a mí no me basta que me destodo lo tuyo.Por eso no seremos nuncala pareja perfecta, la tarjeta postal,si no somos capaces de aceptarque sólo en la aritméticael dos nace del uno más el uno.'),(992,4,6,660,'2021-05-21',4,NULL,'¡La vida brota como un mar violentoDonde la mano del amor golpea!Hoy partió hacia la noche, triste, fría,Rotas las alas, mi melancolía'),(993,7,22,709,'2020-03-14',1,NULL,'Después de puesta la vidatantas veces por su leyal tablero'),(994,26,22,840,'2023-06-03',0,NULL,'Aprovechemos el otoñoantes de que el inverno nos escombreentremos a codazos en la franja del soly admiremos a los pájaros que emigranahora que calienta el corazónaunque sea de a ratos y de a pocopensemos y sintamos todavíacon el viejo cariño que nos quedaaprovechemos el otoñoantes de que el futuro se congeley no haya sitio para la bellezaporque el futuro se nos vuelve escarcha.'),(995,29,27,889,'2020-09-06',1,NULL,'Pues el otro, su heredero,don Enrique, ¡qué poderesalcanzaba!¡Cuán blando, cuán halagueroel mundo con sus placeresse le daba!Mas verás cuán enemigo,cuán contrario, cuán cruelse le mostró,habiéndole sido amigo,¡cuán poco duró con éllo que le dio!'),(996,5,11,18,'2023-12-19',1,NULL,'Qué vanidad imaginarque puedo darte todo, el amor y la dicha,itinerarios, música, juguetes.Es cierto que es así:todo lo mío te lo doy, es cierto,pero todo lo mío no te bastacomo a mí no me basta que me destodo lo tuyo.Por eso no seremos nuncala pareja perfecta, la tarjeta postal,si no somos capaces de aceptarque sólo en la aritméticael dos nace del uno más el uno.'),(997,7,22,262,'2020-03-12',3,NULL,'No todo es días de soly la lluvia cuando falta mucho, se pide.Por eso tomo la infelicidad con la felicidad.Naturalmente como quien no se extrañacon que existan montañas y planicies y que haya rocas y hierbas…Lo que es necesario es ser natural y calmado en la felicidad o en lainfelicidad.'),(998,46,26,60,'2023-11-20',3,NULL,'Estos reyes poderososque vemos por escriturasya pasadas,con casos tristes, llorosos,fueron sus buenas venturastrastornadas.Así que no hay cosa fuerte,que a Papas y Emperadoresy Prelados,así los trata la Muertecomo a los pobres pastoresde ganados.'),(999,17,3,932,'2022-03-15',0,NULL,'El Agua se conoce por la sed'),(1000,17,16,70,'2021-05-19',2,NULL,'mas cumple tener buen tinopara andar esta jornadasin errar.Partimos cuando nacemos,andamos mientras vivimos,y llegamosal tiempo que fenecemos'),(1001,14,5,684,'2023-09-22',1,NULL,'Nosotros, desacostumbrados al valorexiliados del placerenroscados en la caparazón de la soledadhasta que el amor baja de su templo sagradoy se presenta ante nuestros ojospara liberarnos a la vida.Llega el amory en su tren vienen éxtasisviejos recuerdos de gozoantiguas historias de dolor.Y si somos audaces,el amor arranca de nuestras almaslas cadenas del miedo.Al calor de la luz del amorabandonamos nuestra timideznos atrevemos a ser valientesY de pronto vemos que el amornos cuesta todo lo que somosy todo lo que podemos ser.Y sin embargo es el amorlo único que nos libera.'),(1002,42,26,354,'2021-11-08',2,NULL,'Se extingue el díapero no el canto de la alondra'),(1003,43,19,NULL,'2022-08-09',1,'mancha','«No tengamos tiempo yaen esta vida mezquinapor tal modo,que mi voluntad estáconforme con la divinapara todo.Y consiento en mi morircon voluntad placentera,clara y pura,que querer hombre vivircuando Dios quiere que muera,es locura.»'),(1004,50,10,691,'2021-08-16',1,NULL,'Como el viento que encuentrauna rendijay se cuela en la habitacióny lo desordena todolibrosfacturaspoemasasí llegaen la vidael amor.Nada es igual a partir de entonces,ese caoses la felicidad.Pero un día habrá que recoger.Suerte si no te toca a ti.'),(1005,32,18,636,'2021-09-16',3,NULL,'Tú que en tu divinidadjuntaste cosa tan vilcomo es el hombre'),(1006,15,20,NULL,'2023-07-13',1,'él','En el corazón, quizá, o más exacto:Una herida rasgada con navaja,Por donde se va la vida mal gastada,Con total conciencia nos apuñala.El desear, el querer, el no bastar,Equivocada búsqueda de la razónQue el azar de ser nos justifique,Es eso lo que duele, quizá en el corazón.'),(1007,13,21,488,'2020-12-26',0,NULL,'En las noches claras,resuelvo el problema de la soledad del ser.Invito a la luna y con mi sombra somos tres.'),(1008,30,1,746,'2021-08-02',2,NULL,'des que vemos el engañoy queremos dar la vuelta,no hay lugar.'),(1009,39,24,NULL,'2022-11-15',0,'ríos',' cuando pasen los añosy yo solo sea un hombre que amó,un ser que se detuvo un instante frente a tus labios,un pobre hombre cansado de andar por los jardines,¿dónde estarás tú? ¡Dóndeestarás, oh hija de mis besos!'),(1010,33,21,239,'2022-09-15',2,NULL,'Eres como la flor de la rama más alta del cielo.Tu olor viene ¡qué fino!, de tan lejoscomo te subo yo, por la raíz más honda de la tierra, mi beso.'),(1011,40,10,985,'2022-08-24',0,NULL,'Juventud, vasta, lozana, amorosa'),(1012,16,1,818,'2022-08-25',1,NULL,'¿Qué se hizo el rey don Juan?Los infantes de Aragón¿qué se hicieron?¿Qué fue de tanto galán,qué fue de tanta invencióncomo trujeron?Las justas y los torneos,paramentos, bordaduras,y cimeras,¿fueron sino devaneos?¿Qué fueron sino verdurasde las eras?'),(1013,13,16,NULL,'2021-06-18',1,'¡pierden','Yo no te pido nadayo no te acepto nada.Alcanza con que estésen el mundocon que sepas que estoyen el mundocon que seasme seastestigo juez y diosSi no para qué todo.'),(1014,2,18,432,'2022-08-10',1,NULL,'La gentil delicadeza del guiño añadidoque convierte la flaqueza en la fuerza y ligerezapara la alegría en pobreza y el cuerpo dolido.Y sí, a veces sobra la palabra y su sobrevalorado poder escrito.Mejor no dar por hecho y