o me recortes:¡Quiéreme toda… O no me quieras!'),(1026,29,1,NULL,'2022-11-27',0,'el','después de tan bien servidala corona de su reyverdadero'),(1027,26,15,931,'2021-05-18',1,NULL,'cuán presto se va el placer'),(1028,9,27,776,'2020-05-28',1,NULL,'el olvido es la única venganzay el único perdón.'),(1029,26,3,332,'2020-06-14',2,NULL,'¿Qué es poesía?, dices mientras clavasen mi pupila tu pupila azul.¿Qué es poesía? ¿Y tú me lo preguntas?Poesía... eres tú'),(1030,12,1,728,'2020-05-18',3,NULL,'no conozco la historia del fuego.'),(1031,47,11,NULL,'2023-02-17',2,'la','La esperanza es esa cosa con plumasque se posa en el alma,y entona melodías sin palabras,y no se detiene para nada'),(1032,30,16,351,'2023-04-25',0,NULL,'Si un día despertara sin palabras,moriría de hambre o de tristeza.No tengo nada más: la inútil vocaciónde pensar y explicar lo que he pensado.'),(1033,34,19,490,'2023-09-04',1,NULL,'La gentil delicadeza del guiño añadidoque convierte la flaqueza en la fuerza y ligerezapara la alegría en pobreza y el cuerpo dolido.Y sí, a veces sobra la palabra y su sobrevalorado poder escrito.Mejor no dar por hecho y consumir el hecho.Mejor una caricia a una receta.Mejor un gesto a un charlatán rocambolesco.Mejor lo sutil que su hijo tonto el denso.'),(1034,33,2,404,'2021-12-05',0,NULL,'Los estados y riqueza,que nos dejen a deshora¿quién lo duda?No les pidamos firmeza,pues que son de una señoraque se muda,que bienes son de Fortuna,que revuelven con su ruedapresurosa,la cual no puede ser una,ni ser estable ni quedaen una cosa.'),(1035,40,18,509,'2023-10-24',0,NULL,'Aprovechemos el otoñoantes de que el inverno nos escombreentremos a codazos en la franja del soly admiremos a los pájaros que emigranahora que calienta el corazónaunque sea de a ratos y de a pocopensemos y sintamos todavíacon el viejo cariño que nos quedaaprovechemos el otoñoantes de que el futuro se congeley no haya sitio para la bellezaporque el futuro se nos vuelve escarcha.'),(1036,18,21,46,'2022-10-17',2,NULL,'Pues aquel gran CondestableMaestre que conocimos,tan privado,no cumple que dél se hable,sino sólo que lo vimosdegollado.Sus infinitos tesoros,sus villas y sus lugares,su mandar,¿qué le fueron sino lloros?¿que fueron sino pesaresal dejar?'),(1037,48,24,326,'2021-06-19',2,NULL,'¡Qué amigo de sus amigos!,¡qué señor para criadosy parientes!,¡qué enemigo de enemigos!,¡qué maestre de esforzadosy valientes!,¡qué seso para discretos!,¡qué gracia para donosos!,¡qué razón!,¡cuán benigno a los sujetos!,y a los bravos y dañosos,¡qué león!'),(1038,44,13,654,'2021-05-12',0,NULL,'Pues si vemos lo presentecómo en un punto se es idoy acabado,si juzgamos sabiamente,daremos lo no venidopor pasado.No se engañe nadie, no,pensando que ha de durarlo que esperamás que duró lo que vio,pues que todo ha de pasarpor tal manera.'),(1039,42,13,135,'2023-02-01',0,NULL,'En el corazón, quizá, o más exacto:Una herida rasgada con navaja,Por donde se va la vida mal gastada,Con total conciencia nos apuñala.El desear, el querer, el no bastar,Equivocada búsqueda de la razónQue el azar de ser nos justifique,Es eso lo que duele, quizá en el corazón.'),(1040,35,6,NULL,'2023-08-30',2,'acaecen,de','así que, cuando morimos,descansamos.'),(1041,12,4,371,'2022-12-27',2,NULL,'diciendo: «Buen caballero,dejad el mundo engañosoy su halago'),(1042,23,13,569,'2021-08-13',2,NULL,'Este mundo es el caminopara el otro, que es moradasin pesar'),(1043,3,2,NULL,'2021-03-01',0,'y','La tierra ensucia las manospero limpia al hombre.'),(1044,33,1,620,'2021-03-24',1,NULL,'Pero jamás en mí podrá apagarseLa llama de tu amor.'),(1045,7,7,201,'2023-02-03',3,NULL,'dejemos a los romanos,aunque oímos y leímossus historias'),(1046,23,4,368,'2020-11-11',1,NULL,'Yo no sé de pájaros,'),(1047,39,10,751,'2022-09-11',1,NULL,'Si un día despertara sin palabras,moriría de hambre o de tristeza.No tengo nada más: la inútil vocaciónde pensar y explicar lo que he pensado.'),(1048,6,13,268,'2021-01-26',2,NULL,'amar por toda ciencia y amar por todo an