astar,Equivocada búsqueda de la razónQue el azar de ser nos justifique,Es eso lo que duele, quizá en el corazón.'),(1058,21,25,175,'2021-08-26',0,NULL,'por un beso… yo no séqué te diera por un beso.'),(1059,17,25,163,'2022-03-29',1,NULL,'Entraban en mi alcoba sin llamar a la puerta,deshojando en el aire la flor de su perfume.Los oía arrastrarse, leves, hasta la alfombra.Trepaban a la cama y luego, entre las sábanas,me anunciaban el día con sutiles caricias.'),(1060,28,7,728,'2020-06-09',5,NULL,'así que, cuando morimos,descansamos.'),(1061,22,24,398,'2022-04-25',1,NULL,'allí los ríos caudales,allí los otros medianosy más chicos'),(1062,32,9,156,'2022-09-09',2,NULL,'No dejó grandes tesoros,ni alcanzó muchas riquezas,ni vajillas,mas hizo guerra a los moros,ganando sus fortalezasy sus villas.Y en las lides que venció,muchos moros y caballosse perdieron,y en este oficio ganólas rentas y los vasallosque le dieron.'),(1063,2,24,NULL,'2021-07-25',5,'ti,pero','Te hace una seña con la cabezadesde esa niebla de luz. Sonríe.Que sí, que ahorita vuelve.Miras sus gestos, su lejanía,pero no la escuchas. Polvode niebla es la arena.Polvo ficticio el mar.Desde más lejos, frente a ese brilloque lo corta te mira,te hace señas. Que sí, que ahorita vuelve.Que ahorita vuelve.'),(1064,4,15,420,'2021-01-10',2,NULL,'Dejo las invocacionesde los famosos poetasy oradores'),(1065,20,8,NULL,'2022-01-06',2,'burlas,','Amar, amar, amar, amar siempre, con todoel ser y con la tierra y con el cielo,con lo claro del sol y lo oscuro del lodo'),(1066,12,19,760,'2023-12-03',1,NULL,'Un poemacomo una gran batallame arroja en esta arenasin más enemigo que yoyo y el gran airede las palabras'),(1067,16,22,316,'2022-06-04',4,NULL,'Llevo tu corazón conmigo(lo llevo en mi corazón)nunca estoy sin él.(A donde quiera que voy vas tú mi amor'),(1068,5,4,489,'2021-05-27',2,NULL,'Las dádivas desmedidas,los edificios realesllenos de oro,las vajillas tan fabridas,los enriques y realesdel tesoro,los jaeces y caballosde su gente, y atavíostan sobrados,¿dónde iremos a buscallos?¿qué fueron sino rocíosde los prados?'),(1069,7,2,NULL,'2022-07-29',1,'conocimos,tan','así que, cuando morimos,descansamos.'),(1070,18,24,NULL,'2022-09-19',3,'serY','Si un día despertara sin palabras,moriría de hambre o de tristeza.No tengo nada más: la inútil vocaciónde pensar y explicar lo que he pensado.'),(1071,28,11,NULL,'2020-04-14',0,'la','Sé de ciencia ciertaque el amores mejor que las multi-vitaminas,que la pareja humanaes el principio inevitable de la vida,que por eso no quiero jamás liberarme del hombre'),(1072,38,17,489,'2023-02-07',1,NULL,'des que vemos el engañoy queremos dar la vuelta,no hay lugar.'),(1073,16,13,896,'2021-02-21',1,NULL,'Después de puesta la vidatantas veces por su leyal tablero'),(1074,9,24,311,'2023-02-27',3,NULL,'allí los ríos caudales,allí los otros medianosy más chicos'),(1075,5,20,1001,'2022-07-10',1,NULL,'Nosotros, desacostumbrados al valorexiliados del placerenroscados en la caparazón de la soledadhasta que el amor baja de su templo sagradoy se presenta ante nuestros ojospara liberarnos a la vida.Llega el amory en su tren vienen éxtasisviejos recuerdos de gozoantiguas historias de dolor.Y si somos audaces,el amor arranca de nuestras almaslas cadenas del miedo.Al calor de la luz del amorabandonamos nuestra timideznos atrevemos a ser valientesY de pronto vemos que el amornos cuesta todo lo que somosy todo lo que podemos ser.Y sin embargo es el amorlo único que nos libera.'),(1076,3,12,679,'2020-03-26',2,NULL,'dejemos a los romanos,aunque oímos y leímossus historias'),(1077,33,23,385,'2022-03-05',0,NULL,' juventud llena de gracia,fuerza y fascinación.¿Sabes que la Vejez puede venir en pos de ti con la misma gracia,fuerza y fascinación?Día florido y espléndido, día en que brilla un sol inmenso, díade acción, ambición y risa.La Noche te sigue de cerca con un millón de soles, y sueño, yuna oscuridad reparadora.'),(1078,4,23,998,'2023-01-03',2,NULL,'amar por toda ciencia y amar por 