e matada?'),(1087,16,5,NULL,'2023-10-09',2,'fin','No se os haga tan amargala batalla temerosaque esperáis,pues otra vida más largade fama tan gloriosaacá dejáis.Aunque esta vida de honortampoco no es eternal,ni verdadera,mas, con todo, es muy mejorque la vida terrenal,perecedera.'),(1088,24,5,193,'2020-12-09',2,NULL,'aquella prosperidadque tan alta fue subiday ensalzada,¿qué fue sino claridad,que cuando más encendidafue matada?'),(1089,36,4,NULL,'2022-02-23',2,'de','Dudar de lo que nos dijeron y de nuestras propias afirmaciones,de nuestros sentimientos, de nuestros sueños y de nuestros anhelos.Dudar como una manera de vivir el pensamiento y la acción,allí donde nos arroja el riesgo de un discurrir diferente,a la fragilidad de lo inciertoy a la ligereza de lo que se sabe precario,demasiado precario.'),(1090,17,11,NULL,'2020-12-09',0,'la','no sabrán nunca que nos hemos ido.'),(1091,18,13,774,'2020-12-15',3,NULL,'Pues el otro, su heredero,don Enrique, ¡qué poderesalcanzaba!¡Cuán blando, cuán halagueroel mundo con sus placeresse le daba!Mas verás cuán enemigo,cuán contrario, cuán cruelse le mostró,habiéndole sido amigo,¡cuán poco duró con éllo que le dio!'),(1092,41,3,NULL,'2021-11-01',0,'instante','Lo queramos o noSólo tenemos tres alternativas:El ayer, el presente y el mañana.Y ni siquiera tresPorque como dice el filósofoEl ayer es ayerNos pertenece sólo en el recuerdo:A la rosa que ya se deshojóNo se le puede sacar otro pétalo.Las cartas por jugarSon solamente dos:El presente y el día de mañana.Y ni siquiera dosPorque es un hecho bien establecidoQue el presente no existeSino en la medida en que se hace pasadoY ya pasó...,como la juventud.En resumidas cuentasSólo nos va quedando el mañana:Yo levanto mi copaPor ese día que no llega nuncaPero que es lo únicoDe lo que realmente disponemos.'),(1093,9,8,912,'2023-01-10',3,NULL,'Las huestes innumerables,los pendones y estandartes,y banderas,los castillos impugnables,los muros y baluartesy barreras,la cava honda chapada,o cualquier otro reparo,¿qué aprovecha?cuando tú vienes airadatodo lo pasas de clarocon tu flecha.'),(1094,25,21,1003,'2020-11-04',2,NULL,'lo amocon todas sus debilidadesy me gusta compartir con su terquedadtodo este ancho mundodonde ambos nos somos imprescindibles.'),(1095,5,8,213,'2022-11-18',0,NULL,'La lágrima fue dicha.Olvidemosel llantoy empecemos de nuevo,con paciencia,observando las cosashasta hallar la menuda diferenciaque las separade su entidad de ayery que defineel transcurso del tiempo y su eficacia.¿A qué llorar por el caídofruto,por el fracasode ese deseo hondo,compacto como un grano de simiente?No es bueno repetir lo que está dicho.Después de haber hablado,de haber vertido lágrimas,silencio y sonreíd:nada es lo mismoHabrá palabras nuevas para la nueva historiay es preciso encontrarlas antes de que sea tarde.'),(1096,48,13,281,'2020-11-04',0,NULL,'Y pues vos, claro varón,tanta sangre derramasteisde paganos,esperad el galardónque en este mundo ganasteispor las manos.Y con esta confianzay con la fe tan enteraque tenéis,partid con buena esperanza,que esta otra vida tercera,ganaréis.»'),(1097,11,6,NULL,'2023-01-20',1,'el','Tirar por la borda el último intentosólo para ver si flota...... o se hunde'),(1098,24,20,NULL,'2023-04-29',2,'caemos:No','Perder todo es fácil,lo difícil es retener algohasta transformarloen una piedra preciosa,en amuleto.'),(1099,49,19,NULL,'2023-06-09',2,'es','después de tanta hazañaa que no puede bastarcuenta cierta,en la su villa de Ocañavino la Muerte a llamara su puerta'),(1100,17,15,1003,'2021-11-04',3,NULL,'Podrá secarse en un instante el mar'),(1101,31,1,NULL,'2023-07-19',0,'estadoen','¿Mi tierra?Mi tierra eres tú.¿Mi gente?Mi gente eres tú.El destierro y la muertepara mi están adondeno estés tú.¿Y mi vida?Dime, mi vida,¿qué es, si no eres tú?'),(1102,40,13,NULL,'2023-11-09',1,'ríos','Somos obras de arte momentáneamente vivientes.'),(1103,19,17,321,'2023-01-03',1,NULL,'Este mundo es el caminopara el otro, que es moradasin pesar'),(1104,28,6,NULL,'2022-10-19',3,'perdiendo.El','El vivir que es perdurable,no se gana con estadosmundanales,ni con vida deleitable,en que moran los pecadosinfernales,mas los buenos religiosos,ganánlo con oracionesy con lloros,los caballeros famososcon trabajos y afliccionescontra moros.'),(1105,2,16,1006,'2020-05-26',1,NULL,'Dejemos a los troyanos,que sus males no los vimos,ni sus glorias'),(1106,20,11,344,'2022-12-25',3,NULL,'¿Qué se hizo el rey don Juan?Los infantes de Aragón¿qué se hicieron?¿Qué fue de tanto galán,qué fue de tanta invencióncomo trujeron?Las justas y los torneos,paramentos, bordaduras,y cimeras,¿fueron sino devaneos?¿Qué fueron sino verdurasde las eras?'),(1107,33,22,NULL,'2023-11-02',3,'peores','cómo a nuestro parecercualquiera tiempo pasadofue mejor.'),(1108,33,3,635,'2023-08-18',4,NULL,'después de tanta hazañaa que no puede bastarcuenta cierta,en la su villa de Ocañavino la Muerte a llamara su puerta'),(1109,37,26,40,'2021-08-06',1,NULL,' juventud llena de gracia,fuerza y fascinación.¿Sabes que la Vejez puede venir en pos de ti con la misma gracia,fuerza y fascinación?Día florido y espléndido, día en que brilla un sol inmenso, díade acción, ambición y risa.La Noche te sigue de cerca con un millón de soles, y sueño, yuna oscuridad reparadora.'),(1110,32,6,NULL,'2021-06-12',1,'pero','Ponerlo todo en duda es el único modo de ordenarme'),(1111,45,21,NULL,'2022-07-12',2,'vajillas,mas','Y sus villas y sus tierrasocupadas de tiranoslas halló,mas por cercos y por guerrasy por fuerza de sus manoslas cobró.Pues nuestro rey natural,si de las obras que obrófue servido,dígalo el de Portugal,y en Castilla quien siguiósu partido.'),(1112,13,20,NULL,'2021-07-28',2,'superior','si puedes encontrarte con el triunfo y el fracaso,y tratar a esos dos impostores de la misma manera.Si puedes soportar oír la verdad que has dicho,tergiversada por villanos para engañar a los necios.O ver cómo se destruye todo aquello por lo que has dado la vida,y remangarte para reconstruirlo con herramientas desgastadas.Si puedes apilar todas tus gananciasy arriesgarlas a una sola jugada'),(1113,33,16,943,'2021-03-23',5,NULL,'y pues de vida y saludhicisteis tan poca cuentapor la fama,esfuércese la virtudpor sufrir esta afrentaque os llama.'),(1114,5,16,815,'2021-06-30',1,NULL,'Te hace una seña con la cabezadesde esa niebla de luz. Sonríe.Que sí, que ahorita vuelve.Miras sus gestos, su lejanía,pero no la escuchas. Polvode niebla es la arena.Polvo ficticio el mar.Desde más lejos, frente a ese brilloque lo corta te mira,te hace señas. Que sí, que ahorita vuelve.Que ahorita vuelve.'),(1115,20,8,440,'2022-01-27',3,NULL,'tu vida es tu vidano dejes que sea golpeada contra la húmeda sumisiónmantente alertahay salidashay una luz en algún lugarpuede que no sea mucha luz perovence a la oscuridadmantente alertalos dioses te ofrecerán oportunidadesconócelastómalasno puedes vencer a la muerte peropuedes vencer a la muerte en la vida, a vecesy mientras más a menudo aprendas a hacerlomás luz habrátu vida es tu vidaconócela mientras la tengastú eres maravillosolos dioses esperan para deleitarseen tí.'),(1116,36,7,NULL,'2022-03-17',0,'luna','Si fuese en nuestro podertornar la cara hermosacorporal,como podemos hacerel alma tan gloriosaangelical,¡qué diligencia tan vivatuviéramos cada hora,y tan prestaen componer la cautiva,dejándonos la señoradescompuesta!'),(1117,1,10,527,'2021-07-09',2,NULL,'Mi táctica esmirarteaprender como sosquererte como sosmi táctica eshablartey escucharteconstruir con palabrasun puente indestructiblemi táctica esquedarme en tu recuerdono sé cómoni sécon qué pretextopero quedarme en vosmi táctica esser francoy saber que sos francay que no nos vendamossimulacrospara que entre los dosno haya telónni abismosmi estrategia esen cambiomás profunda y mássimplemi estrategia esque un día cualquierano sé cómoni sécon qué pretextopor finme necesites.'),(1118,49,19,NULL,'2022-01-02',2,'perfecta','vino el pájaroy devoró al gusanovino el hombrey devoró al pájarovino el gusanoy devoró al hombre'),(1119,18,17,422,'2020-01-04',3,NULL,'La tierra - por los Mares navegados.El Éxtasis - por el tormento-La Paz - por el recuento de sus batallas-El Amor, por el Moho de la Memoria-Por la Nieve, los Pájaros.'),(1120,2,6,157,'2022-09-11',1,NULL,'Siéntatea la mesa.Bebe un vasode agua. Saboreacada trago.Y piensaen todo el tiempoque has perdido.El que estás perdiendo.El tiempoque te queda por perder.'),(1121,16,18,375,'2023-12-25',2,NULL,'Hoy me he arrepentidode todas las tormentas de veranoen las que me puse a cubierto.'),(1122,37,17,NULL,'2023-05-27',4,'que','La gentil delicadeza del guiño añadidoque convierte la flaqueza en la fuerza y ligerezapara la alegría en pobreza y el cuerpo dolido.Y sí, a veces sobra la palabra y su sobrevalorado poder escrito.Mejor no dar por hecho y consumir el hecho.Mejor una caricia a una receta.Mejor un gesto a un charlatán rocambolesco.Mejor lo sutil que su hijo tonto el denso.'),(1123,14,17,442,'2023-06-27',0,NULL,'no curo de sus ficciones,que traen yerbas secretassus sabores.A Aquel sólo me encomiendo,Aquel sólo invoco yode verdad,que, en este mundo viviendo,el mundo no conociósu deidad.'),(1124,6,6,643,'2021-07-15',3,NULL,'Después de puesta la vidatantas veces por su leyal tablero'),(1125,7,17,NULL,'2021-05-19',2,'el','El bastón, las monedas, el llavero,la dócil cerradura, las tardíasnotas que no leerán los pocos díasque me quedan, los naipes y el tablero,un libro y en sus páginas la ajadavioleta, monumento de una tardesin duda inolvidable y ya olvidada,el rojo espejo occidental en que ardeuna ilusoria aurora. ¡Cuántas cosas,láminas, umbrales, atlas, copas, clavos,nos sirven como tácitos esclavos,ciegas y extrañamente sigilosas!Durarán más allá de nuestro olvido'),(1126,41,20,252,'2023-10-10',2,NULL,'no curemos de saberlo de aquel siglo pasado,qué fue de ello'),(1127,44,19,541,'2022-06-21',0,NULL,'mas cumple tener buen tinopara andar esta jornadasin errar.Partimos cuando nacemos,andamos mientras vivimos,y llegamosal tiempo que fenecemos'),(1128,16,2,1025,'2020-05-17',3,NULL,'Como el viento que encuentrauna rendijay se cuela en la habitacióny lo desordena todolibrosfacturaspoemasasí llegaen la vidael amor.Nada es igual a partir de entonces,ese caoses la felicidad.Pero un día habrá que recoger.Suerte si no te toca a ti.'),(1129,37,8,945,'2023-10-30',5,NULL,'¡pero eso sí! -y en esto soy irreductible- no les perdono, bajo ningún pretexto, que no sepan volar.Si no saben volar ¡pierden el tiempo las que pretendan seducirme!'),(1130,24,26,NULL,'2021-09-25',2,'somosy','así que, cuando morimos,descansamos.'),(1131,4,13,NULL,'2023-11-04',2,'seasme','Así, con tal entender,todos sentidos humanosconservados,cercado de su mujer,Y de sus hijos y hermanosy criados,dio el alma a quien se la dio,el cual la ponga en el cieloy en su gloria,y aunque la vida perdió,dejónos harto consuelosu memoria.'),(1132,23,7,192,'2023-09-05',2,NULL,'Mi táctica esmirarteaprender como sosquererte como sosmi táctica eshablartey escucharteconstruir con palabrasun puente indestructiblemi táctica esquedarme en tu recuerdono sé cómoni sécon qué pretextopero quedarme en vosmi táctica esser francoy saber que sos francay que no nos vendamossimulacrospara que entre los dosno haya telónni abismosmi estrategia esen cambiomás profunda y mássimplemi estrategia esque un día cualquierano sé cómoni sécon qué pretextopor finme necesites.'),(1133,25,15,NULL,'2023-04-19',2,'prometía.;Antonio','Yo no sé de pájaros,'),(1134,6,14,447,'2020-05-16',1,NULL,'Nuestras vidas son los ríosque van a dar en la mar,que es el morir:allí van los señoríos,derechos a se acabary consumir'),(1135,33,7,194,'2023-02-04',4,NULL,'La tierra ensucia las manospero limpia al hombre.'),(1136,37,15,NULL,'2023-04-15',3,'quien','Yo no sé de pájaros,'),(1137,22,22,410,'2023-08-29',2,NULL,' cuando pasen los añosy yo solo sea un hombre que amó,un ser que se detuvo un instante frente a tus labios,un pobre hombre cansado de andar por los jardines,¿dónde estarás tú? ¡Dóndeestarás, oh hija de mis besos!'),(1138,43,23,544,'2020-09-23',3,NULL,'mas cumple tener buen tinopara andar esta jornadasin errar.Partimos cuando nacemos,andamos mientras vivimos,y llegamosal tiempo que fenecemos'),(1139,48,1,522,'2022-12-30',2,NULL,'cómo a nuestro parecercualquiera tiempo pasadofue mejor.'),(1140,6,11,1105,'2020-05-26',2,NULL,'Si me quieres, quiéreme entera,no por zonas de luz o sombra…Si me quieres, quiéreme negray blanca, Y gris, verde, y rubia,y morena…Quiéreme día,quiéreme noche…¡Y madrugada en la ventana abierta!…Si me quieres, no me recortes:¡Quiéreme toda… O no me quieras!'),(1141,50,25,212,'2023-06-25',1,NULL,'Y donde aquello que hago yo soloes gracias a ti, mi cielo).No le temo al destino(ya que tu eres mi destino, cariño).No quiero ningún mundo (porque hermosatu eres mi mundo, mi bien).Este es el secreto más profundo que nadie conoce…(Esta es la raíz de la raízy el brote del brotey el cielo del cielo de un árbol llamado vida'),(1142,25,10,8,'2022-06-03',2,NULL,'así que, cuando morimos,descansamos.'),(1143,17,16,987,'2023-11-20',1,NULL,'El vivir que es perdurable,no se gana con estadosmundanales,ni con vida deleitable,en que moran los pecadosinfernales,mas los buenos religiosos,ganánlo con oracionesy con lloros,los caballeros famososcon trabajos y afliccionescontra moros.'),(1144,17,14,NULL,'2021-01-03',2,'cierta,en','En ventura Octaviano,Julio César en vencery batallar,En la virtud, Africano,Aníbal en el sabery trabajar,En la bondad un Trajano,Tito en liberalidadcon alegría,En su brazo, AurelianoMarco Atilio en la verdadque prometía.'),(1145,23,9,354,'2023-05-20',1,NULL,'después de tanta hazañaa que no puede bastarcuenta cierta,en la su villa de Ocañavino la Muerte a llamara su puerta'),(1146,30,18,587,'2023-05-23',1,NULL,'No dejó grandes tesoros,ni alcanzó muchas riquezas,ni vajillas,mas hizo guerra a los moros,ganando sus fortalezasy sus villas.Y en las lides que venció,muchos moros y caballosse perdieron,y en este oficio ganólas rentas y los vasallosque le dieron.'),(1147,47,2,563,'2021-08-06',2,NULL,'vino el pájaroy devoró al gusanovino el hombrey devoró al pájarovino el gusanoy devoró al hombre'),(1148,34,25,430,'2022-06-08',3,NULL,'Lo queramos o noSólo tenemos tres alternativas:El ayer, el presente y el mañana.Y ni siquiera tresPorque como dice el filósofoEl ayer es ayerNos pertenece sólo en el recuerdo:A la rosa que ya se deshojóNo se le puede sacar otro pétalo.Las cartas por jugarSon solamente dos:El presente y el día de mañana.Y ni siquiera dosPorque es un hecho bien establecidoQue el presente no existeSino en la medida en que se hace pasadoY ya pasó...,como la juventud.En resumidas cuentasSólo nos va quedando el mañana:Yo levanto mi copaPor ese día que no llega nuncaPero que es lo únicoDe lo que realmente disponemos.'),(1149,13,17,270,'2020-04-15',2,NULL,'Pasarán estos días como pasantodos los días malos de la vidaAmainarán los vientos que te arrasanSe estancará la sangre de tu heridaEl alma errante volverá a su nidoLo que ayer se perdió será encontradoEl sol será sin mancha concebidoy saldrá nuevamente en tu costadoY dirás frente al mar: ¿Cómo he podidoanegado sin brújula y perdidollegar a puerto con las velas rotas?Y una voz te dirá: ¿Que no lo sabes?El mismo viento que rompió tus naveses el que hace volar a las gaviotas'),(1150,16,10,NULL,'2022-05-25',0,'tu','Podrá nublarse el sol eternamente'),(1151,41,10,868,'2023-07-20',1,NULL,'un cutis de durazno o de papel de lija.Le doy una importancia igual a cero,al hecho de que amanezcan con un aliento afrodisíacoo con un aliento insecticida.Soy perfectamente capaz de soportarlesuna nariz que sacaría el primer premioen una exposición de zanahorias'),(1152,39,10,92,'2022-09-15',1,NULL,'vengamos a lo de ayer,que también es olvidadocomo aquello.'),(1153,10,4,939,'2020-04-24',2,NULL,'¿Qué se hizo el rey don Juan?Los infantes de Aragón¿qué se hicieron?¿Qué fue de tanto galán,qué fue de tanta invencióncomo trujeron?Las justas y los torneos,paramentos, bordaduras,y cimeras,¿fueron sino devaneos?¿Qué fueron sino verdurasde las eras?'),(1154,5,2,1148,'2020-04-16',2,NULL,'Dejemos a los troyanos,que sus males no los vimos,ni sus glorias'),(1155,37,3,NULL,'2021-11-21',1,'juventud','Se extingue el díapero no el canto de la alondra'),(1156,4,17,808,'2020-10-10',1,NULL,'Aprovechemos el otoñoantes de que el inverno nos escombreentremos a codazos en la franja del soly admiremos a los pájaros que emigranahora que calienta el corazónaunque sea de a ratos y de a pocopensemos y sintamos todavíacon el viejo cariño que nos quedaaprovechemos el otoñoantes de que el futuro se congeley no haya sitio para la bellezaporque el futuro se nos vuelve escarcha.'),(1157,21,14,1132,'2023-09-05',2,NULL,'«No tengamos tiempo yaen esta vida mezquinapor tal modo,que mi voluntad estáconforme con la divinapara todo.Y consiento en mi morircon voluntad placentera,clara y pura,que querer hombre vivircuando Dios quiere que muera,es locura.»'),(1158,15,24,NULL,'2022-11-21',1,'es','Aquél de buenos abrigo,amado por virtuosode la gente,el Maestre don RodrigoManrique, tanto famosoy tan valiente,sus grandes hechos y clarosno cumple que los alabe,pues los vieron,ni los quiero hacer caros,pues que el mundo todo sabecuáles fueron.'),(1159,17,20,239,'2023-12-12',1,NULL,'Aprovechemos el otoñoantes de que el inverno nos escombreentremos a codazos en la franja del soly admiremos a los pájaros que emigranahora que calienta el corazónaunque sea de a ratos y de a pocopensemos y sintamos todavíacon el viejo cariño que nos quedaaprovechemos el otoñoantes de que el futuro se congeley no haya sitio para la bellezaporque el futuro se nos vuelve escarcha.'),(1160,23,3,NULL,'2021-03-06',2,'fuerza','tu vida es tu vidano dejes que sea golpeada contra la húmeda sumisiónmantente alertahay salidashay una luz en algún lugarpuede que no sea mucha luz perovence a la oscuridadmantente alertalos dioses te ofrecerán oportunidadesconócelastómalasno puedes vencer a la muerte peropuedes vencer a la muerte en la vida, a vecesy mientras más a menudo aprendas a hacerlomás luz habrátu vida es tu vidaconócela mientras la tengastú eres maravillosolos dioses esperan para deleitarseen tí.'),(1161,33,8,9,'2021-07-23',0,NULL,'Yo no sé de pájaros,'),(1162,48,21,213,'2021-09-02',3,NULL,'Si puedes mantener la cabeza en su sitio cuando todos a tu alrededorla pierden y te culpan a ti.Si puedes seguir creyendo en ti mismo cuando todos dudan de ti,pero también aceptas que tengan dudas.Si puedes esperar y no cansarte de la espera'),(1163,25,14,NULL,'2021-06-17',2,'soledadde','Nosotros, desacostumbrados al valorexiliados del placerenroscados en la caparazón de la soledadhasta que el amor baja de su templo sagradoy se presenta ante nuestros ojospara liberarnos a la vida.Llega el amory en su tren vienen éxtasisviejos recuerdos de gozoantiguas historias de dolor.Y si somos audaces,el amor arranca de nuestras almaslas cadenas del miedo.Al calor de la luz del amorabandonamos nuestra timideznos atrevemos a ser valientesY de pronto vemos que el amornos cuesta todo lo que somosy todo lo que podemos ser.Y sin embargo es el amorlo único que nos libera.'),(1164,4,9,638,'2021-07-12',2,NULL,'Aférrate a tus sueñosporque si los sueños muerenla vida es como un pájaro de alas rotasincapaz de volar.Aférrate a tus sueñosporque si los sueños se marchanla vida es como un campo yermocubierto de escarcha.'),(1165,49,18,339,'2022-10-25',3,NULL,'Como una vieja mancha de dolorEn la sombra lejana se deslíe...¡Mi vida toda canta, besa, ríe!¡Mi vida toda es una boca en flor!'),(1166,21,1,268,'2023-07-29',1,NULL,'Dejemos a los troyanos,que sus males no los vimos,ni sus glorias'),(1167,8,26,28,'2021-02-05',1,NULL,'tu vida es tu vidano dejes que sea golpeada contra la húmeda sumisiónmantente alertahay salidashay una luz en algún lugarpuede que no sea mucha luz perovence a la oscuridadmantente alertalos dioses te ofrecerán oportunidadesconócelastómalasno puedes vencer a la muerte peropuedes vencer a la muerte en la vida, a vecesy mientras más a menudo aprendas a hacerlomás luz habrátu vida es tu vidaconócela mientras la tengastú eres maravillosolos dioses esperan para deleitarseen tí.'),(1168,40,21,552,'2020-10-03',1,NULL,'Se extingue el díapero no el canto de la alondra'),(1169,38,10,NULL,'2023-08-17',2,'como','no curo de sus ficciones,que traen yerbas secretassus sabores.A Aquel sólo me encomiendo,Aquel sólo invoco yode verdad,que, en este mundo viviendo,el mundo no conociósu deidad.'),(1170,24,11,277,'2020-06-09',1,NULL,'Amar, amar, amar, amar siempre, con todoel ser y con la tierra y con el cielo,con lo claro del sol y lo oscuro del lodo:Amar por toda ciencia y amar por todo anhelo.Y cuando la montaña de la vidanos sea dura y larga y alta y llena de abismos,Amar la inmensidad que es de amor encendida¡y arder en la fusión de nuestros pechos mismos!'),(1171,39,25,NULL,'2023-08-22',1,'cabezadesde','No todo es días de soly la lluvia cuando falta mucho, se pide.Por eso tomo la infelicidad con la felicidad.Naturalmente como quien no se extrañacon que existan montañas y planicies y que haya rocas y hierbas…Lo que es necesario es ser natural y calmado en la felicidad o en lainfelicidad.'),(1172,39,10,15,'2022-12-14',0,NULL,'Como el viento que encuentrauna rendijay se cuela en la habitacióny lo desordena todolibrosfacturaspoemasasí llegaen la vidael amor.Nada es igual a partir de entonces,ese caoses la felicidad.Pero un día habrá que recoger.Suerte si no te toca a ti.'),(1173,48,13,888,'2021-11-04',1,NULL,'¡La vida brota como un mar violentoDonde la mano del amor golpea!Hoy partió hacia la noche, triste, fría,Rotas las alas, mi melancolía'),(1174,45,13,713,'2022-10-21',0,NULL,'Podrá secarse en un instante el mar'),(1175,38,26,433,'2021-02-24',1,NULL,'No todo es días de soly la lluvia cuando falta mucho, se pide.Por eso tomo la infelicidad con la felicidad.Naturalmente como quien no se extrañacon que existan montañas y planicies y que haya rocas y hierbas…Lo que es necesario es ser natural y calmado en la felicidad o en lainfelicidad.'),(1176,8,1,NULL,'2023-07-09',1,'eso','En ventura Octaviano,Julio César en vencery batallar,En la virtud, Africano,Aníbal en el sabery trabajar,En la bondad un Trajano,Tito en liberalidadcon alegría,En su brazo, AurelianoMarco Atilio en la verdadque prometía.'),(1177,4,24,NULL,'2021-06-05',2,'rigorde','Y pues vos, claro varón,tanta sangre derramasteisde paganos,esperad el galardónque en este mundo ganasteispor las manos.Y con esta confianzay con la fe tan enteraque tenéis,partid con buena esperanza,que esta otra vida tercera,ganaréis.»'),(1178,15,26,522,'2022-06-10',1,NULL,'Tú que por nuestra maldadtomaste forma servily bajo nombre'),(1179,30,20,94,'2020-03-25',2,NULL,'El vivir que es perdurable,no se gana con estadosmundanales,ni con vida deleitable,en que moran los pecadosinfernales,mas los buenos religiosos,ganánlo con oracionesy con lloros,los caballeros famososcon trabajos y afliccionescontra moros.'),(1180,25,14,919,'2020-06-28',0,NULL,'Este mundo bueno fuesi bien usásemos dél,como debemos,porque, según nuestra fe,es para ganar aquelque atendemos.Y aun aquel Hijo de Dios,para subirnos al cielo,descendióa nacer acá entre nosy a vivir en este suelodo murió.'),(1181,26,23,NULL,'2022-07-28',1,'cielo;por','El vivir que es perdurable,no se gana con estadosmundanales,ni con vida deleitable,en que moran los pecadosinfernales,mas los buenos religiosos,ganánlo con oracionesy con lloros,los caballeros famososcon trabajos y afliccionescontra moros.'),(1182,30,25,550,'2021-04-23',3,NULL,'y pues de vida y saludhicisteis tan poca cuentapor la fama,esfuércese la virtudpor sufrir esta afrentaque os llama.'),(1183,46,18,NULL,'2023-01-02',0,'en','Nosotros, desacostumbrados al valorexiliados del placerenroscados en la caparazón de la soledadhasta que el amor baja de su templo sagradoy se presenta ante nuestros ojospara liberarnos a la vida.Llega el amory en su tren vienen éxtasisviejos rec