Dios,para subirnos al cielo,descendióa nacer acá entre nosy a vivir en este suelodo murió.'),(1191,33,7,750,'2021-05-01',1,NULL,'Ten Esperanza. Si hay nubarrones,si hay desengaños y no ilusiones,descoge el ceño, su sombra es vana,que a toda noche sigue un mañana.'),(1192,44,5,676,'2022-09-18',0,NULL,'Pues por su honra y estadoen otros tiempos pasados¿cómo se hubo?Quedando desamparado,con hermanos y criadosse sostuvo.Después que hechos famososhizo en esta dicha guerraque hacía,hizo tratos tan honrosos,que le dieron aun más tierraque tenía.'),(1193,11,24,1102,'2023-11-09',3,NULL,'Podrá nublarse el sol eternamente'),(1194,11,6,1103,'2021-11-07',0,NULL,'después de tan bien servidala corona de su reyverdadero'),(1195,10,21,NULL,'2022-09-24',2,'-','Aférrate a tus sueñosporque si los sueños muerenla vida es como un pájaro de alas rotasincapaz de volar.Aférrate a tus sueñosporque si los sueños se marchanla vida es como un campo yermocubierto de escarcha.'),(1196,5,11,NULL,'2022-04-17',1,'cosa','¡La vida brota como un mar violentoDonde la mano del amor golpea!Hoy partió hacia la noche, triste, fría,Rotas las alas, mi melancolía'),(1197,40,18,NULL,'2020-09-06',4,'ojos','Hay cosas peores queestar solopero a menudo toma décadasdarse cuenta de elloy más a menudocuando esto ocurrees demasiado tardey no hay nada peorqueun demasiado tarde.'),(1198,44,24,917,'2021-06-11',0,NULL,'si puedes pensar y no hacer de tus pensamientos tu único objetivo'),(1199,25,25,195,'2021-12-15',0,NULL,'Siéntatea la mesa.Bebe un vasode agua. Saboreacada trago.Y piensaen todo el tiempoque has perdido.El que estás perdiendo.El tiempoque te queda por perder.'),(1200,29,21,948,'2020-04-01',1,NULL,'Podrá secarse en un instante el mar'),(1201,48,3,409,'2023-04-20',0,NULL,'Pero digo que, acompañeny lleguen hasta la huesacon su dueño,por eso no nos engañen,pues se va la vida apriesa,como sueño,y los deleites de acáson, en que nos deleitamos,temporales,y los tormentos de allá,que por ellos esperamos,eternales.'),